INSERT INTO `catalog_product_entity_text` VALUES ('1',85,0,'1','Samsung'),('2',76,0,'1','<div class=\"warranty-item\"><span class=\"itemLeft\">Thời gian bảo hành: </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">12 Tháng</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Hình thức bảo hành: </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Điện tử</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành: </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành chính hãng</span></div>'),('3',75,0,'1','<p><strong>Hàng chính hãng Samsung Việt Nam, Nguyên seal, Mới 100%, Chưa Active</strong><br /><strong>Màn hình: </strong>Super AMOLED, 6.4\", độ phân giải 2340 x 1080 (FHD+)<br /><strong>Hệ điều hành:</strong> Android 10<br /><strong>Camera sau:</strong> 64.0 MP + 8.0 MP + 5.0 MP + 5.0 MP<br /><strong>Camera trước:</strong> 32.0 MP<br /><strong>CPU:</strong> Exynos 9611<br /><strong>RAM:</strong> 6 GB<br /><strong>Bộ nhớ trong:</strong> 128 GB<br /><strong>Thẻ nhớ:</strong> MicroSD, hỗ trợ tối đa 512 GB<br /><strong>Thẻ SIM:</strong> 2 Nano SIM<br /><strong>Dung lượng pin:</strong> 6000 mAh<br /><strong>Tính năng khác:</strong> Chặn cuộc gọi, Sạc pin nhanh, Đèn pin, Dolby Audio, Chặn tin nhắn</p>\r\n<p> </p>'),('4',75,0,'2','<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">THÔNG TIN CHI TIẾT</h4>\r\n<div class=\"group\">\r\n<div class=\"content has-table\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Dung lượng pin</td>\r\n<td>8000 mAh</td>\r\n</tr>\r\n<tr>\r\n<td>Bluetooth</td>\r\n<td>v5.0</td>\r\n</tr>\r\n<tr>\r\n<td>Thương hiệu</td>\r\n<td>Samsung</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ thương hiệu</td>\r\n<td>Hàn Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Camera sau</td>\r\n<td>13MP + 5MP</td>\r\n</tr>\r\n<tr>\r\n<td>Camera trước</td>\r\n<td>8.0 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ thẻ nhớ ngoài</td>\r\n<td>MicroSD</td>\r\n</tr>\r\n<tr>\r\n<td>Chip set</td>\r\n<td>Snapdragon 865+</td>\r\n</tr>\r\n<tr>\r\n<td>Chức năng khác</td>\r\n<td>Sạc nhanh 45W</td>\r\n</tr>\r\n<tr>\r\n<td>Tốc độ CPU</td>\r\n<td>1 x Cortex A77 3.2 GHz + 3 x Cortex A77 2.4 GHz + 4 x Cortex A55 1.8 GHz</td>\r\n</tr>\r\n<tr>\r\n<td>Loại/ Công nghệ màn hình</td>\r\n<td>LTPS IPS LCD</td>\r\n</tr>\r\n<tr>\r\n<td>GPS</td>\r\n<td>A-GPS, GLONASS, BDS, GALILEO</td>\r\n</tr>\r\n<tr>\r\n<td>Phụ kiện đi kèm</td>\r\n<td>Sách hướng dẫn, cáp sạc, bút cảm ứng</td>\r\n</tr>\r\n<tr>\r\n<td>Model</td>\r\n<td>Galaxy Tab S7 Wifi T870 (6GB/128GB)</td>\r\n</tr>\r\n<tr>\r\n<td>Jack tai nghe</td>\r\n<td>Type-C</td>\r\n</tr>\r\n<tr>\r\n<td>Loại pin</td>\r\n<td>Lithium-ion</td>\r\n</tr>\r\n<tr>\r\n<td>Nghe nhạc</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ</td>\r\n<td>Việt Nam/Ấn Độ/Trung Quốc (Tùy từng đợt nhập hàng)</td>\r\n</tr>\r\n<tr>\r\n<td>Pin có thể tháo rời</td>\r\n<td>Pin liền</td>\r\n</tr>\r\n<tr>\r\n<td>Cổng sạc</td>\r\n<td>Type-C</td>\r\n</tr>\r\n<tr>\r\n<td>Trọng lượng</td>\r\n<td>500g</td>\r\n</tr>\r\n<tr>\r\n<td>Quay phim</td>\r\n<td>Full HD</td>\r\n</tr>\r\n<tr>\r\n<td>RAM</td>\r\n<td>6GB</td>\r\n</tr>\r\n<tr>\r\n<td>Độ phân giải</td>\r\n<td>WQXGA (2560 x 1600)</td>\r\n</tr>\r\n<tr>\r\n<td>ROM</td>\r\n<td>128GB</td>\r\n</tr>\r\n<tr>\r\n<td>Tính năng camera</td>\r\n<td>HDR, Tự động lấy nét, Panorama, Flash LED, Chế độ làm đẹp, Chụp góc rộng, Chụp góc siêu rộng, ISO Setting, Zoom Kỹ thuật số, Cài đặt cân bằng trắng, Gắn thẻ ảnh địa lý, Phát hiện khuôn mặt</td>\r\n</tr>\r\n<tr>\r\n<td>Video call</td>\r\n<td>Có - Video Call Qua Ứng Dụng OTT</td>\r\n</tr>\r\n<tr>\r\n<td>Wifi</td>\r\n<td>Wi-Fi 802.11 a/b/g/n/ac, Dual-band, DLNA, Wi-Fi Direct,</td>\r\n</tr>\r\n<tr>\r\n<td>Xem phim</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>SKU</td>\r\n<td>5191686802025</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div class=\"group\">\r\n<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">MÔ TẢ SẢN PHẨM</h4>\r\n<div class=\"content\">\r\n<div class=\"ToggleContent__Wrapper-sc-1hm81e2-1 iGyNLs\">\r\n<div class=\"ToggleContent__View-sc-1hm81e2-0 eIzUuC\">\r\n<div>\r\n<h5>Tính di động của máy tính bảng, hiệu suất của PC</h5>\r\n<p>Có thiết kế siêu mỏng nhẹ, gọn gàng di động của một chiếc máy tính bảng cao cấp hàng đầu, nhưng M<strong>áy Tính Bảng Samsung Galaxy Tab S7 Wifi T870</strong> còn mang trên mình sức mạnh của máy tính để bàn với cấu hình xuất sắc. Bộ vi xử lý Snapdragon 865+ sản xuất trên tiến trình 7nm+, với 8 nhân xung nhịp tối đa lên tới 3.09 GHz đi cùng GPU đồ họa Adreno 650 siêu mạnh, giúp mọi tác vụ đều trở nên mượt mà.</p>\r\n<p><img id=\"https://salt.tikicdn.com/ts/tmp/30/cc/c8/dfe31152dec4ed68accfe62773575aad.jpg\" title=\"\" src=\"https://salt.tikicdn.com/ts/tmp/30/cc/c8/dfe31152dec4ed68accfe62773575aad.jpg\" alt=\"\" width=\"750\" height=\"407\" /></p>\r\n<p>Không chỉ vậy, với phụ kiện bàn phím tùy chọn và giao diện tối ưu, Galaxy Tab S7 Wifi T870 cho trải nghiệm tương tự PC, đáp ứng hoàn hảo công việc.</p>\r\n<h5>Chơi game cực đỉnh</h5>\r\n<p>Samsung Galaxy Tab S7 Wifi T870 là chiếc máy tính bảng tuyệt vời cho chơi game nhờ cấu hình hàng đầu và màn hình 120 Hz siêu mượt mà. Hình ảnh 3D được tái hiện sắc nét, tốc độ khung hình cao, cho bạn đắm chìm vào trong thế giới game của riêng mình. Tha hồ giải trí và thể hiện kỹ năng trong các tựa game yêu thích.</p>\r\n<p><img id=\"https://salt.tikicdn.com/ts/tmp/ad/79/0e/bd1da40ca8a634997d99a3f2904d30a8.jpg\" title=\"\" src=\"https://salt.tikicdn.com/ts/tmp/ad/79/0e/bd1da40ca8a634997d99a3f2904d30a8.jpg\" alt=\"\" width=\"750\" height=\"470\" /></p>\r\n<h5>Bút S Pen tốt nhất từ trước đến nay cho máy tính bảng</h5>\r\n<p>S Pen trên Samsung Galaxy Tab S7 Wifi T870 được cải tiến với đầu bút siêu mảnh, độ nhạy tối đa và độ trễ chỉ 9ms, cho trải nghiệm viết vẽ chân thực chưa từng thấy. S Pen mang đến loạt tính năng hấp dẫn như ghi âm khi đang ghi chú; điều khiển thiết bị từ xa, giúp bạn có thể ghi chú và tương tác với máy tính bảng một cách chuyên nghiệp.</p>\r\n<p><img id=\"https://salt.tikicdn.com/ts/tmp/ef/2b/6f/2e84a1a5cb54dd9ff4c8aa28503ddb4f.jpg\" title=\"\" src=\"https://salt.tikicdn.com/ts/tmp/ef/2b/6f/2e84a1a5cb54dd9ff4c8aa28503ddb4f.jpg\" alt=\"\" width=\"750\" height=\"443\" /></p>\r\n<h5>Rạp chiếu phim ngay trên tay bạn</h5>\r\n<p>Trước mắt bạn sẽ là màn hình lớn tới 11 inch, độ phân giải siêu cao, hỗ trợ HDR10+ và tần số quét 120Hz, cho khả năng hiển thị chuẩn điện ảnh cùng với sự mượt mà vượt trội. Không chỉ màn hình, âm thanh Galaxy Tab S7 Wifi T870 cũng vô cùng sống động nhờ hệ thống 4 loa công nghệ Dolby Atmos, được tinh chỉnh bởi AKG. Những bộ phim bom tấn sẽ được thể hiện theo cách tuyệt vời hơn bao giờ hết trên Samsung Galaxy Tab S7 Wifi T870.</p>\r\n<p><img id=\"https://salt.tikicdn.com/ts/tmp/1f/c1/ae/c305504b778eb752976a492faf267b49.jpg\" title=\"\" src=\"https://salt.tikicdn.com/ts/tmp/1f/c1/ae/c305504b778eb752976a492faf267b49.jpg\" alt=\"\" width=\"750\" height=\"428\" /></p>\r\n<h5>Chụp ảnh và chia sẻ</h5>\r\n<p>Trên Samsung Galaxy Tab S7 Wifi T870, bạn có thể chụp hình, quay phim chất lượng cao và nhanh chóng chia sẻ cho bạn bè nhờ bộ đôi camera kép có khả năng quay video tới 4K. Camera chính 13MP và camera góc siêu rộng 5MP mang tới những hình ảnh rõ nét, độ sáng tuyệt vời. Trong khi đó camera trước 8MP sẽ rất hữu ích cho những cuộc gọi video hay những cuộc họp trực tuyến.</p>\r\n<p><img id=\"https://salt.tikicdn.com/ts/tmp/e5/67/0e/e91575d1bab848d3b9ce2cc75a4e68cc.jpg\" title=\"\" src=\"https://salt.tikicdn.com/ts/tmp/e5/67/0e/e91575d1bab848d3b9ce2cc75a4e68cc.jpg\" alt=\"\" width=\"750\" height=\"443\" /></p>\r\n<h5>Sử dụng thoải mái, sạc cực nhanh</h5>\r\n<p>Với dung lượng pin lớn 8000 mAh, bạn có thể sử dụng Samsung Galaxy Tab S7 Wifi T870 thoải mái trong nhiều ngày. Máy tính bảng cho thời gian sử dụng liên tục lên đến khoảng 15 giờ, đủ để đáp ứng mọi nhu cầu của bạn. Ngoài ra Galaxy Tab S7 Wifi T870 còn hỗ trợ công nghệ sạc siêu nhanh công suất tối đa 45W, nhanh chóng bổ sung năng lượng chỉ sau 20 – 30 phút.</p>\r\n<p><img id=\"https://salt.tikicdn.com/ts/tmp/4b/35/8b/e650f30852fedb9eefd9ebb4f4de2f1d.jpg\" title=\"\" src=\"https://salt.tikicdn.com/ts/tmp/4b/35/8b/e650f30852fedb9eefd9ebb4f4de2f1d.jpg\" alt=\"\" width=\"750\" height=\"422\" /></p>\r\n<h5>Vẻ đẹp của tương lai</h5>\r\n<p>Samsung Galaxy Tab S7 Wifi T870 sở hữu một thiết kế mê hoặc với những đường nét sang trọng, không điểm chết. Được hoàn thiện từ kim loại nguyên khối, tuyệt đẹp và độ mỏng khó tin 6,3mm, Galaxy Tab S7 Wifi T870 nhìn như một sản phẩm đến từ tương lai. Thiết kế ngôn ngữ phẳng, cân đối, viền màn hình siêu mỏng và sự tinh tế là điều bạn có thể cảm nhận ở bất cứ vị trí nào trên Galaxy Tab S7 Wifi T870. Kể cả phần đặt bút S Pen cũng rất độc đáo, tạo nên sự đẳng cấp riêng biệt.</p>\r\n<p><img id=\"https://salt.tikicdn.com/ts/tmp/21/63/56/3ed5bcb84c51ae519bc270a8452e00c1.jpg\" title=\"\" src=\"https://salt.tikicdn.com/ts/tmp/21/63/56/3ed5bcb84c51ae519bc270a8452e00c1.jpg\" alt=\"\" width=\"750\" height=\"431\" /></p>\r\n<p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Tuy nhiên tuỳ vào từng loại sản phẩm hoặc phương thức, địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, ...</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),('5',76,0,'2','<div class=\"warranty-item\"><span class=\"itemLeft\">Thời gian bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">12 Tháng</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Hình thức bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Điện tử</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành chính hãng</span></div>'),('6',85,0,'2','Máy Tính Bảng Samsung Galaxy Tab S7 Wifi T870 (6GB/128GB) - Hàng Chính Hãng'),('7',75,0,'3','<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">THÔNG TIN CHI TIẾT</h4>\r\n<div class=\"group\">\r\n<div class=\"content has-table\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Dung lượng pin</td>\r\n<td>4230 mAh</td>\r\n</tr>\r\n<tr>\r\n<td>Bluetooth</td>\r\n<td>A2DP, LE, v5.0</td>\r\n</tr>\r\n<tr>\r\n<td>Thương hiệu</td>\r\n<td>OPPO</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ thương hiệu</td>\r\n<td>Trung Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Camera sau</td>\r\n<td>Chính 13 MP &amp; Phụ 2 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Camera trước</td>\r\n<td>5 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ thẻ nhớ ngoài</td>\r\n<td>MicroSD</td>\r\n</tr>\r\n<tr>\r\n<td>Chip đồ họa (GPU)</td>\r\n<td>PowerVR GE8320</td>\r\n</tr>\r\n<tr>\r\n<td>Chip set</td>\r\n<td>MediaTek Helio P35 8 nhân</td>\r\n</tr>\r\n<tr>\r\n<td>Chức năng khác</td>\r\n<td>Đèn pin; Trợ lý ảo Google Assistant; Chặn tin nhắn; Khoá ứng dụng; Nhân bản ứng dụng; Không gian trẻ em ;Đa cửa sổ (chia đôi màn hình); Không gian trò chơi; Ghi âm cuộc gọi; Chặn cuộc gọi;Mở khóa bằng vân tay, Mở khoá khuôn mặt</td>\r\n</tr>\r\n<tr>\r\n<td>Kết nối khác</td>\r\n<td>OTG</td>\r\n</tr>\r\n<tr>\r\n<td>Đèn Flash</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>Kích thước</td>\r\n<td>\r\n<p>Dài 155.9 mm - Ngang 75.5 mm - Dày 8.3 mm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>Loại/ Công nghệ màn hình</td>\r\n<td>IPS LCD</td>\r\n</tr>\r\n<tr>\r\n<td>FM radio</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>Ghi âm</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>GPS</td>\r\n<td>BDS, A-GPS, GLONASS</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ 4G</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>Phụ kiện đi kèm</td>\r\n<td>Sách HDSD, Sạc</td>\r\n</tr>\r\n<tr>\r\n<td>Jack tai nghe</td>\r\n<td>3.5 mm</td>\r\n</tr>\r\n<tr>\r\n<td>Số sim</td>\r\n<td>2</td>\r\n</tr>\r\n<tr>\r\n<td>Loại Sim</td>\r\n<td>Nano SIM</td>\r\n</tr>\r\n<tr>\r\n<td>Nghe nhạc</td>\r\n<td>AMR, MP3, WAV, eAAC+</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ</td>\r\n<td>Trung Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Cổng sạc</td>\r\n<td>Micro USB</td>\r\n</tr>\r\n<tr>\r\n<td>Trọng lượng</td>\r\n<td>165 g</td>\r\n</tr>\r\n<tr>\r\n<td>Quay phim</td>\r\n<td>Quay phim HD 720p@30fps, Quay phim FullHD 1080p@30fps</td>\r\n</tr>\r\n<tr>\r\n<td>RAM</td>\r\n<td>3 GB</td>\r\n</tr>\r\n<tr>\r\n<td>Độ phân giải</td>\r\n<td>HD+ (720 x 1520 Pixels)</td>\r\n</tr>\r\n<tr>\r\n<td>ROM</td>\r\n<td>32 GB</td>\r\n</tr>\r\n<tr>\r\n<td>Kích thước màn hình</td>\r\n<td>6.22 inch</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ thẻ tối đa</td>\r\n<td>256 GB</td>\r\n</tr>\r\n<tr>\r\n<td>Tính năng camera</td>\r\n<td>A.I Camera, Trôi nhanh thời gian (Time Lapse), Xoá phông, Nhãn dán (AR Stickers), Làm đẹp, Tự động lấy nét (AF), Chạm lấy nét, Nhận diện khuôn mặt, HDR, Toàn cảnh (Panorama), Chuyên nghiệp (Pro)</td>\r\n</tr>\r\n<tr>\r\n<td>Video call</td>\r\n<td>Hỗ trợ VideoCall thông qua ứng dụng</td>\r\n</tr>\r\n<tr>\r\n<td>Wifi</td>\r\n<td>Wi-Fi 802.11 a/b/g/n/ac, Dual-band, DLNA, Wi-Fi Direct, Wi-Fi hotspot</td>\r\n</tr>\r\n<tr>\r\n<td>Xem phim</td>\r\n<td>MP4, AVI, WMV, H.264(MPEG4-AVC)</td>\r\n</tr>\r\n<tr>\r\n<td>SKU</td>\r\n<td>6677224030262</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div class=\"group\">\r\n<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">MÔ TẢ SẢN PHẨM</h4>\r\n<div class=\"content\">\r\n<div class=\"ToggleContent__Wrapper-sc-1hm81e2-1 iGyNLs\">\r\n<div class=\"ToggleContent__View-sc-1hm81e2-0 eIzUuC\">\r\n<div>Màn hình: IPS LCD, 6.22\", HD+<br />Hệ điều hành: ColorOS 6.1 (Android 9.0)<br />Camera sau: Chính 13 MP &amp; Phụ 2 MP<br />Camera trước: 5 MP<br />CPU: MediaTek Helio P35 8 nhân<br />RAM: 3 GB<br />Bộ nhớ trong: 32 GB<br />Thẻ nhớ: MicroSD<br />Thẻ SIM:<br />2 Nano SIM, Hỗ trợ 4G<br />Dung lượng pin: 4230 mAh\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/e8/24/76/677c5496806db0f04853cd96d3b56bf4.jpg\" alt=\"Điện Thoại Oppo A12 (3GB/32GB) - Hàng Chính Hãng - Xanh Dương\" width=\"750px\" height=\"416px\" /></p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/3f/c4/eb/ca1586398aebdc3161d93ec0efbc6367.jpg\" alt=\"Điện Thoại Oppo A12 (3GB/32GB) - Hàng Chính Hãng - Xanh Dương\" width=\"750px\" height=\"416px\" /></p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/80/70/61/8f30ae00b01fa54765385d43d16ae5f9.jpg\" alt=\"Điện Thoại Oppo A12 (3GB/32GB) - Hàng Chính Hãng - Xanh Dương\" width=\"750px\" height=\"416px\" /></p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/23/1e/eb/eb31b0611695021ecb2e686ef58b7f5e.jpg\" alt=\"Điện Thoại Oppo A12 (3GB/32GB) - Hàng Chính Hãng - Xanh Dương\" width=\"750px\" height=\"416px\" /></p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/80/c1/c4/947abc96f6d8278a1d399537fa50cfe2.jpg\" alt=\"Điện Thoại Oppo A12 (3GB/32GB) - Hàng Chính Hãng - Xanh Dương\" width=\"750px\" height=\"416px\" /></p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/cc/aa/00/1f7ddb7cf6997f82c0a097822b3be9c6.jpg\" alt=\"Điện Thoại Oppo A12 (3GB/32GB) - Hàng Chính Hãng - Xanh Dương\" width=\"750px\" height=\"416px\" /></p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/60/d8/30/514a0d0dfa3ccfcaedafe1759dda02bd.jpg\" alt=\"Điện Thoại Oppo A12 (3GB/32GB) - Hàng Chính Hãng - Xanh Dương\" width=\"750px\" height=\"416px\" /></p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/ec/a8/08/0861d2f8e350c453c0cc410d91afb000.jpg\" alt=\"Điện Thoại Oppo A12 (3GB/32GB) - Hàng Chính Hãng - Xanh Dương\" width=\"750px\" height=\"416px\" /></p>\r\n<h5 dir=\"ltr\">Màn hình giọt nước tràn viền</h5>\r\n<p dir=\"ltr\"><strong>OPPO A12</strong> vẫn sở hữu thiết kế quen thuộc trên điện thoại Android với màn hình giọt nước tràn viền ra các cạnh.</p>\r\n<p dir=\"ltr\">Màn hình của máy có kích thước 6.22 inch độ phân giải HD+, tất nhiên với thông số này OPPO A12 không hiển thị siêu nét như trên các điện thoại cao cấp, tuy nhiên máy vấn đáp ứng ở tốt ở mức hình ảnh rõ ràng, màu sắc tốt, đọc thông tin và xem phim thoải mái.</p>\r\n<p dir=\"ltr\">Màn hình của OPPO A12 còn được phủ kính cường lực Gorilla Glass 3 giúp bảo vệ máy khỏi bị trầy xước hay va chạm.</p>\r\n<p dir=\"ltr\">Mặt lưng của máy được thiết kế bằng chất liệu nhựa nhám với các họa tiết đường cắt kim cương độc đáo.</p>\r\n<p dir=\"ltr\">Mặt lưng này được thiết kế với các góc cạnh cong nhẹ nhàng vừa cho cảm giác cầm nắm tốt còn góp phần trong việc hạn chế bám mồ hôi và dấu vân tay.</p>\r\n<p dir=\"ltr\">Ngoài ra, máy còn được trang bị cảm biến vân tay ở mặt lưng giúp mở khóa thiết bị nhanh chóng hơn.</p>\r\n<h5 dir=\"ltr\">Camera kép lưu giữ các khoảnh khắc thường ngày</h5>\r\n<p dir=\"ltr\">OPPO A12 được trang bị cụm camera kép ở phía sau, bao gồm một camera chính có độ phân giải 13 MP và camera phụ 2 MP hỗ trợ chụp ảnh chân dung xóa phông.</p>\r\n<p dir=\"ltr\">Cụm camera kép này vừa đủ để mang đến những trải nghiệm đủ dùng, giúp bạn bắt được những khoảnh khắc đáng giá một cách nhanh nhất.  </p>\r\n<p dir=\"ltr\">Bên cạnh đó máy cũng được trang bị rất nhiều tính năng chụp ảnh thông minh khác nhau như Beauty, chụp ảnh với Sticker, chụp món ăn,… Người dùng có thể tự do khám phá và trải nghiệm.</p>\r\n<p dir=\"ltr\">OPPO A12 còn được trang bị camera selfie độ phân giải 5 MP ở mặt trước dễ dàng lưu lại những khoảnh khắc vui vẻ cùng bạn bè và người thân. Hỗ trợ gọi video bằng ứng dụng rõ nét.</p>\r\n<h5 dir=\"ltr\">Hiệu năng sử dụng mượt mà hàng ngày</h5>\r\n<p dir=\"ltr\">OPPO A12 mang trong mình sức mạnh của vi xử lý MediaTek Helio P35 8 nhân, kết hợp với RAM 3 GB và bộ nhớ trong 32 GB có hỗ trợ thẻ nhớ ngoài MicroSD với dung lượng lên tới 256 GB.</p>\r\n<p dir=\"ltr\">Hiệu năng của máy được đánh giá đáp ứng tốt nhu cầu xử lý các tác vụ hằng ngày như giải trí xem phim hay chơi các tựa game nhẹ như Hay Day, Candy C</p>\r\n<p dir=\"ltr\">OPPO A12 được cài sẵn Android 9 (Pie) với giao diện ColorOS 6.1.2 hỗ trợ các thuật toán cũng như tính năng AI nhằm tối ưu hiệu suất xử lý cũng như điện năng mang tới trải nghiệm sử dụng mượt mà, thông minh.</p>\r\n<h5 dir=\"ltr\">Thời lượng pin đáp ứng tốt cho ngày dài</h5>\r\n<p dir=\"ltr\">OPPO A12 được trang bị viên pin 4.230 mAh có hỗ trợ sạc nhanh góp phần mang tới những trải nghiệm giải trí, sử dụng được trọn vẹn và liên tục.</p>\r\n<p dir=\"ltr\">Khá tiếc rằng máy lại được trang bị cổng Micro USB thay vì USB Type C, tuy nhiên, với một thiết bị giá rẻ thì điều này hoàn toàn có thể chấp nhận được. Máy vẫn giữ lại cổng tai nghe 3.5 mm và trang bị Bluetooth 5.0 nhanh và tiết kiệm pin hơn.</p>\r\n<p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Tuy nhiên tuỳ vào từng loại sản phẩm hoặc phương thức, địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, ...</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),('8',76,0,'3','<div class=\"warranty-item\"><span class=\"itemLeft\">Thời gian bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">12 Tháng</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Hình thức bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Tem bảo hành</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành bởi nhà bán hàng thông qua Tiki</span></div>'),('9',85,0,'3','Điện Thoại Oppo A12 (3GB/32GB) - Hàng Chính Hãng'),('10',75,0,'4','<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">THÔNG TIN CHI TIẾT</h4>\r\n<div class=\"group\">\r\n<div class=\"content has-table\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Dung lượng pin</td>\r\n<td>4000 mAh</td>\r\n</tr>\r\n<tr>\r\n<td>Bluetooth</td>\r\n<td>A2DP, LE, v5.0</td>\r\n</tr>\r\n<tr>\r\n<td>Thương hiệu</td>\r\n<td>Samsung</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ thương hiệu</td>\r\n<td>Hàn Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Camera sau</td>\r\n<td>Chính 48 MP &amp; Phụ 12 MP, 5 MP, 5 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Camera trước</td>\r\n<td>32 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ thẻ nhớ ngoài</td>\r\n<td>MicroSD</td>\r\n</tr>\r\n<tr>\r\n<td>Chip set</td>\r\n<td>Exynos 9611 8 nhân</td>\r\n</tr>\r\n<tr>\r\n<td>Kết nối khác</td>\r\