38</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div class=\"group\">\r\n<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">MÔ TẢ SẢN PHẨM</h4>\r\n<div class=\"content\">\r\n<div class=\"ToggleContent__Wrapper-sc-1hm81e2-1 iGyNLs\">\r\n<div class=\"ToggleContent__View-sc-1hm81e2-0 eIzUuC\">\r\n<div>Hàng chính hãng Samsung Việt Nam, Nguyên seal, Mới 100%, Chưa Active<br />Màn hình: Super AMOLED, 6.5\", Full HD+<br />Hệ điều hành: Android 10<br />Camera sau: Chính 48 MP &amp; Phụ 12 MP, 5 MP, 5 MP<br />Camera trước: 32 MP<br />CPU: Exynos 9611 8 nhân<br />RAM: 6 GB<br />Bộ nhớ trong: 128 GB<br />Thẻ nhớ: MicroSD, hỗ trợ tối đa 512 GB<br />Thẻ SIM: 2 Nano SIM, Hỗ trợ 4G<br />Dung lượng pin: 4000 mAh, có sạc nhanh<br />Bảo mật: Mở khoá vân tay siêu âm, Khuôn mặt<br />Tính năng đặc biệt: Đèn pin, Chạm 2 lần sáng màn hình, Sạc pin nhanh, Chặn cuộc gọi, Ghi âm cuộc gọi, Chặn tin nhắn, Mặt kính 2.5D, Màn hình luôn hiển thị AOD, Trợ lý ảo Samsung Bixby, Thu nhỏ màn hình sử dụng một tay, Nhân bản ứng dụng, Không gian trò chơi</div>\r\n<div> </div>\r\n<div>\r\n<h5>Bắt trọn đường nét mọi tuyệt tác</h5>\r\n<p><strong>Điện Thoại Samsung Galaxy A51 (6GB/128GB) - Hàng Chính Hãng</strong> được thiết kế trẻ trung với màu sắc độc đáo, 4 camera sau chuyên nghiệp, Samsung Galaxy A51 sẵn sàng đột phá cùng bạn để tạo nên những bức ảnh độc đáo, nghệ thuật như máy ảnh chuyên nghiệp.</p>\r\n<p>Galaxy A51 giúp bạn khám phá những điều nhỏ nhất của cuộc sống bằng camera Macro chuyên chụp cận cảnh. Khả năng lấy nét ở cự ly siêu gần 3-5cm giúp bạn lưu giữ lại những vật thể nhỏ bé với vẻ đẹp tự nhiên, mang đến trải nghiệm chụp ảnh hoàn toàn mới trên điện thoại.</p>\r\n<p><img id=\"https://salt.tikicdn.com/ts/tmp/dd/a4/2d/92f8c9770d36129ecd612b5d1462fa48.jpg\" title=\"\" src=\"https://salt.tikicdn.com/ts/tmp/dd/a4/2d/92f8c9770d36129ecd612b5d1462fa48.jpg\" alt=\"\" width=\"750\" height=\"417\" /></p>\r\n<h5>4 camera sau AI 48MP đẳng cấp</h5>\r\n<p>Chỉ là một chiếc điện thoại nhưng Galaxy A51 có thể chụp được những bức ảnh chuyên nghiệp trong mọi hoàn cảnh.<img id=\"https://salt.tikicdn.com/ts/tmp/e2/c2/29/e2bfedbc5d09f5241cb34e9189e34252.jpg\" title=\"\" src=\"https://salt.tikicdn.com/ts/tmp/e2/c2/29/e2bfedbc5d09f5241cb34e9189e34252.jpg\" alt=\"\" width=\"750\" height=\"392\" /></p>\r\n<p>Với 4 camera sau đẳng cấp, Galaxy A51 có thể chụp ảnh sắc nét bằng camera 48MP; chụp ảnh góc siêu rộng 123 độ bằng camera 12MP; chụp ảnh xóa phông nhờ sự hỗ trợ của camera độ sâu 5MP và chụp ảnh cận cảnh Macro siêu độc.</p>\r\n<p>Công nghệ AI thông minh giúp nhận diện 30 chủ thể, tối ưu hoá hình ảnh cho hình ảnh độc đáo, mang dấu ấn riêng. </p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/45/9e/cb/991e6c9696a66346321e211477f4db88.jpg\" alt=\"\" width=\"750\" height=\"475\" /></p>\r\n<h5>Sở hữu màn hình Infinity O cong, tràn viền vô cực 6,5 inch Super AMOLED</h5>\r\n<p>Tận hưởng những nội dung sống động trên màn hình tràn viền vô cực 6,5 inch Super AMOLED Full HD+ cực đã với hình ảnh sắc nét và màu sắc rực rỡ tuyệt đẹp. Samsung sử dụng màn hình vô cực Infinity-O thế hệ mới với camera selfie nằm ngay trong màn hình, để bạn có được trải nghiệm hình ảnh liền lạc và thú vị hơn bao giờ hết.</p>\r\n<p><img id=\"https://salt.tikicdn.com/ts/tmp/d5/1a/6f/88f400fc748a1468a6bbeaad2ca5e9d4.jpg\" title=\"\" src=\"https://salt.tikicdn.com/ts/tmp/d5/1a/6f/88f400fc748a1468a6bbeaad2ca5e9d4.jpg\" alt=\"\" width=\"750\" height=\"459\" /></p>\r\n<h5>Thời lượng pin ấn tượng, sạc nhanh siêu tốc</h5>\r\n<p>Galaxy A51 có viên pin với dung lượng 4000 mAh. Với dung lượng này, người dùng sẽ không gặp khó khăn gì về thời lượng pin trong một ngày dài sử dụng. </p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/9d/6f/07/07819bddd1299c95b4cf83bc0cb137b7.jpg\" alt=\"\" width=\"750\" height=\"371\" /></p>\r\n<p>Chưa hết, Galaxy A51 còn trang bị công nghệ sạc nhanh ưu việt 15W, chỉ với 10 phút sạc cho 3 giờ liên lạc, 3 giờ xem phim và 10 giờ nghe nhạc đảm bảo trải nghiệm giải trí xuyên suốt ngày dài.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/78/78/08/69e97718450d3fd437bddd98cccc82e0.jpg\" alt=\"\" width=\"750\" height=\"530\" /></p>\r\n<h5>Cảm biến bằng vân tay</h5>\r\n<p>Cảm biến vân tay được tích hợp dưới màn hình, dù Samsung chỉ trang bị cảm biến quang học nhưng vẫn mang lại kết quả hấp dẫn. Việc bảo mật điện thoại được tốt hơn và mở thao tác nhanh chóng hơn.</p>\r\n<p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Tuy nhiên tuỳ vào từng loại sản phẩm hoặc phương thức, địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, ...</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),('11',76,0,'4','<div class=\"warranty-item\"><span class=\"itemLeft\">Thời gian bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">12 Tháng</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Hình thức bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Điện tử</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành chính hãng</span></div>'),('12',85,0,'4','Điện Thoại Samsung Galaxy A51 (6GB/128GB) - Hàng Chính Hãng'),('13',75,0,'5','<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">THÔNG TIN CHI TIẾT</h4>\r\n<div class=\"group\">\r\n<div class=\"content has-table\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Dung lượng pin</td>\r\n<td>5000 mAh</td>\r\n</tr>\r\n<tr>\r\n<td>Bluetooth</td>\r\n<td>LE, A2DP, v4.2</td>\r\n</tr>\r\n<tr>\r\n<td>Thương hiệu</td>\r\n<td>Samsung</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ thương hiệu</td>\r\n<td>Hàn Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Camera sau</td>\r\n<td>Chính 12 MP &amp; Phụ 5 MP, 2 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Camera trước</td>\r\n<td>8 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ thẻ nhớ ngoài</td>\r\n<td>MicroSD</td>\r\n</tr>\r\n<tr>\r\n<td>Chip đồ họa (GPU)</td>\r\n