HDR, Tự động lấy nét (AF), Làm đẹp (Beautify), Quay video Full HD</td>\r\n</tr>\r\n<tr>\r\n<td>Video call</td>\r\n<td>Hỗ trợ VideoCall thông qua ứng dụng</td>\r\n</tr>\r\n<tr>\r\n<td>Wifi</td>\r\n<td>Wi-Fi 802.11 b/g/n, Wi-Fi Direct, Wi-Fi hotspot</td>\r\n</tr>\r\n<tr>\r\n<td>Xem phim</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>SKU</td>\r\n<td>3318692703879</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div class=\"group\">\r\n<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">MÔ TẢ SẢN PHẨM</h4>\r\n<div class=\"content\">\r\n<div class=\"ToggleContent__Wrapper-sc-1hm81e2-1 iGyNLs\">\r\n<div class=\"ToggleContent__View-sc-1hm81e2-0 eIzUuC\">\r\n<div>Hàng chính hãng Samsung Việt Nam, Nguyên seal, Mới 100%, Chưa Active<br />Màn hình: PLS TFT LCD, 6.4\"<br />Độ phân giải: 720 x 1560 (HD+)<br />Hệ điều hành: Android<br />Camera sau: 13.0 MP + 2.0 MP + 5.0 MP<br />Camera trước: 8.0 MP<br />RAM: 3 GB<br />Bộ nhớ trong: 32 GB<br />Thẻ nhớ: MicroSD, hỗ trợ tối đa 512 GB<br />Thẻ SIM: 2 Nano SIM<br />Dung lượng pin: 5000 mAh<br />Tính năng: Gia tốc, Cảm biến vân tay, Cảm biến ánh sáng, Cảm biến tiệm cận\r\n<h5>Trải Nghiệm Màn Hình Infinity-O Ấn Tượng</h5>\r\n<p>Đắm chìm trong những màn game đỉnh cao hay thoả thích tận hưởng những nội dung video bạn yêu thích trên tuyệt tác màn hình tràn viền Infinity-O HD+ 6.4 inch từ <strong>Samsung Galaxy M11</strong>.<br /><img src=\"https://salt.tikicdn.com/ts/tmp/62/42/48/830b96af19deed18c7cc810bcbe3959b.jpg\" alt=\"Điện Thoại Samsung Galaxy M11 (32GB/3GB) - Hàng Chính Hãng\" width=\"750\" height=\"665\" /></p>\r\n<h5>Thiết Kế Sành Điệu, Dễ Dàng Sử Dụng</h5>\r\n<p>Với khung viền tinh giản và những sắc màu thời thượng: Đen Vô Cực và Xanh Đại Dương, Galaxy M11 khẳng định phong cách hiện đại nơi bạn. Tận hưởng cảm giác dễ chịu khi sử dụng nhờ những đường cong mềm mại trên thiết kế đối xứng từ Samsung.<br /><img src=\"https://salt.tikicdn.com/ts/tmp/91/d2/9e/a909c42ae3a5dd952d8529904e184f21.jpg\" alt=\"Điện Thoại Samsung Galaxy M11 (32GB/3GB) - Hàng Chính Hãng\" width=\"750\" height=\"652\" /></p>\r\n<h5>Bộ Ba Camera Đỉnh Cao</h5>\r\n<p>Lưu giữ khoảnh khắc từ mọi góc nhìn với bộ ba camera đỉnh cao. Camera chính 13MP cho mọi bức hình luôn rõ ràng, sắc nét hoàn hảo bất kể ngày đêm. Chụp xoá phông chuyên nghiệp với camera Cảm Biến Chiều Sâu 2MP. Mở rộng khung hình, bắt trọn khoảnh khắc với camera Góc Siêu Rộng 5MP ấn tượng.<br /><img src=\"https://salt.tikicdn.com/ts/tmp/4f/01/bf/c4475c854771cb9ae366129a3829f451.jpg\" alt=\"Điện Thoại Samsung Galaxy M11 (32GB/3GB) - Hàng Chính Hãng\" width=\"750\" height=\"692\" /></p>\r\n<h5>Góc Nhìn Toàn Cảnh Siêu Rộng</h5>\r\n<p>Sự kết hợp giữa camera Góc Rộng 77 độ và Góc Siêu Rộng 115 độ trong Galaxy M11 giúp bạn chụp toàn cảnh dễ dàng hơn bao giờ hết. Chụp điều bạn thấy, trọn vẹn từng chi tiết.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/1b/87/64/97a2d50f89e59cf2c27bf5c24ee69bec.jpg\" alt=\"Điện Thoại Samsung Galaxy M11 (32GB/3GB) - Hàng Chính Hãng\" width=\"750\" height=\"761\" /></p>\r\n<h5>Kiến Tạo Khung Hình Ấn Tượng</h5>\r\n<p>Làm mờ hậu cảnh để nổi bật chủ thể bạn yêu thích với camera Cảm Biến Chiều Sâu 2MP ưu việt từ Galaxy M11. Dễ dàng điều chỉnh độ sâu trường ảnh trước và sau khi chụp, nâng tầm chuyên nghiệp cho bức hình bạn chụp thêm hoàn hảo.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/f4/70/fd/5a2d581006f5c262d71f1e37cb3eac86.jpg\" alt=\"Điện Thoại Samsung Galaxy M11 (32GB/3GB) - Hàng Chính Hãng\" width=\"750\" height=\"738\" /></p>\r\n<h5>Luôn Nổi Bật Trong Mọi Khung Hình</h5>\r\n<p>Selfie hoàn hảo mọi lúc với camera trước 8MP siêu đỉnh từ Galaxy M11. Tính năng Live Focus làm mờ hậu cảnh, giúp bạn luôn là trung tâm của mọi bức hình bất kể không gian chụp.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/80/5d/8b/845ae745f368dc0a4d3a0df412ec8f4e.jpg\" alt=\"Điện Thoại Samsung Galaxy M11 (32GB/3GB) - Hàng Chính Hãng\" width=\"750\" height=\"942\" /></p>\r\n<h5>Cấu Hình Mượt, Lướt Cực Nhanh</h5>\r\n<p>Bộ xử lý Octa-Core mạnh mẽ cùng với RAM 3/4GB (tùy chọn) giúp bạn chơi game mượt mà và xem video trực tuyến tốc độ cao. Lưu giữ hình ảnh, tài liệu quan trọng và nhiều hơn thế nữa với bộ nhớ trong 32/64GB (tùy chọn) và bộ nhớ ngoài lên đến 512GB.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/8f/f1/e8/d0c8b919484e4db4240fb91e5950d90e.jpg\" alt=\"Điện Thoại Samsung Galaxy M11 (32GB/3GB) - Hàng Chính Hãng\" width=\"750\" height=\"611\" /></p>\r\n<h5>Tràn Đầy Năng Lượng Cả Ngày</h5>\r\n<p>Dung lượng pin lên đến 5,000mAh (tiêu chuẩn*) cho phép bạn thoải mái xem phim, đàm thoại video suốt ngày dài mà không lo gián đoạn. Công Nghệ Sạc Nhanh 15W giúp điện thoại nhanh chóng sạc đầy cho trải nghiệm liền mạch tối ưu.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/63/a9/b3/edbc9839be910b9abdef57ca2028c433.jpg\" alt=\"Điện Thoại Samsung Galaxy M11 (32GB/3GB) - Hàng Chính Hãng\" width=\"750\" height=\"632\" /></p>\r\n<h5>Truy Cập Dễ Dàng - Bảo Mật Tối Ưu</h5>\r\n<p>Cảm Biến Vân Tay - Đơn giản hóa việc truy cập vào điện thoại với công nghệ Cảm Biến Vân Tay đặt sau thân máy, chỉ cần chạm nhẹ để mở máy và truy cập ngay vào các ứng dụng bạn cần.</p>\r\n<p>Nhận Diện Khuôn Mặt - Đơn giản giữ điện thoại trước mặt để mở khoá. Công nghệ Nhận Diện Khuôn Mặt giúp bạn truy cập nhanh chóng mà vẫn bảo mật tối ưu, tránh các nguy cơ đánh mất dữ liệu cá nhân.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/c2/e7/de/261bb9192a2bc1440b3754190f65e085.jpg\" alt=\"Điện Thoại Samsung Galaxy M11 (32GB/3GB) - Hàng Chính Hãng\" width=\"750\" height=\"327\" /></p>\r\n<h5>Duy Trì Thiết Bị Galaxy Luôn Trong Tình Trạng Tốt Nhất</h5>\r\n<p>Dễ dàng thực hiện chẩn đoán tình trạng thiết bị hay nhận những mẹo hữu ích và hỗ trợ kỹ thuật nhanh chóng với ứng dụng Samsung Members. Cho bạn thoả sức trải nghiệm, hoàn toàn yên tâm khi sử dụng điện thoại Galaxy.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/47/28/8c/ff4539c256b8a91655853e8daf2c1114.jpg\" alt=\"Điện Thoại Samsung Galaxy M11 (32GB/3GB) - Hàng Chính Hãng\" width=\"750\" height=\"550\" /></p>\r\n<p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Tuy nhiên tuỳ vào từng loại sản phẩm hoặc phương thức, địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, ...</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),('14',76,0,'5','<p>T<span class=\"itemLeft\">hời gian bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">12 Tháng</span></p>\r\n<p><span class=\"itemLeft\">Hình thức bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Điện tử</span></p>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành chính hãng</span></div>'),('15',85,0,'5','Điện Thoại Samsung Galaxy M11 (3GB/32GB) - Hàng Chính Hãng'),('16',75,0,'6','<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">THÔNG TIN CHI TIẾT</h4>\r\n<div class=\"group\">\r\n<div class=\"content has-table\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Dung lượng pin</td>\r\n<td>5000 mAh</td>\r\n</tr>\r\n<tr>\r\n<td>Bluetooth</td>\r\n<td>v5.0</td>\r\n</tr>\r\n<tr>\r\n<td>Thương hiệu</td>\r\n<td>Vivo</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ thương hiệu</td>\r\n<td>Trung Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Camera sau</td>\r\n<td>Chính 13 MP &amp; Phụ 2 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Camera trước</td>\r\n<td>8 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ thẻ nhớ ngoài</td>\r\n<td>MicroSD</td>\r\n</tr>\r\n<tr>\r\n<td>Chip đồ họa (GPU)</td>\r\n<td>IMG PowerVR GE8320</td>\r\n</tr>\r\n<tr>\r\n<td>Chip set</td>\r\n<td>MediaTek Helio P35 8 nhân</td>\r\n</tr>\r\n<tr>\r\n<td>Chức năng khác</td>\r\n<td>OTG</td>\r\n</tr>\r\n<tr>\r\n<td>Tốc độ CPU</td>\r\n<td>4 nhân 2.3 GHz &amp; 4 nhân 1.8 GHz</td>\r\n</tr>\r\n<tr>\r\n<td>Kết nối dữ liệu</td>\r\n<td>2G, 3G, 4G, Bluetooth, Wifi</td>\r\n</tr>\r\n<tr>\r\n<td>Đèn Flash</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>Kích thước</td>\r\n<td>164.41 mm X76.32 mm X8.41 mm</td>\r\n</tr>\r\n<tr>\r\n<td>Loại/ Công nghệ màn hình</td>\r\n<td>IPS LCD</td>\r\n</tr>\r\n<tr>\r\n<td>FM radio</td>\r\n<td>Không</td>\r\n</tr>\r\n<tr>\r\n<td>GPS</td>\r\n<td>BDS, GALILEO, GLONASS, A-GPS</td>\r\n</tr>\r\n<tr>\r\n<td>Phụ kiện đi kèm</td>\r\n<td> Hộp, Sạc, Sách hướng dẫn, Cáp, Cây lấy sim, Ốp lưng</td>\r\n</tr>\r\n<tr>\r\n<td>Model</td>\r\n<td>Y12s</td>\r\n</tr>\r\n<tr>\r\n<td>Jack tai nghe</td>\r\n<td>3.5 mm</td>\r\n</tr>\r\n<tr>\r\n<td>Số sim</td>\r\n<td>2</td>\r\n</tr>\r\n<tr>\r\n<td>Loại pin</td>\r\n<td>Li-Po</td>\r\n</tr>\r\n<tr>\r\n<td>Loại Sim</td>\r\n<td>Nano SIM</td>\r\n</tr>\r\n<tr>\r\n<td>Nghe nhạc</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ</td>\r\n<td>Trung Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Cổng sạc</td>\r\n<td>Micro USB</td>\r\n</tr>\r\n<tr>\r\n<td>Trọng lượng</td>\r\n<td>191g</td>\r\n</tr>\r\n<tr>\r\n<td>Quay phim</td>\r\n<td>FullHD 1080p@30fps, HD 720p@30fps</td>\r\n</tr>\r\n<tr>\r\n<td>RAM</td>\r\n<td>3G/4GB</td>\r\n</tr>\r\n<tr>\r\n<td>Độ phân giải</td>\r\n<td>HD+ (720 x 1600 pixels)</td>\r\n</tr>\r\n<tr>\r\n<td>ROM</td>\r\n<td>32GB/128GB</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ thẻ tối đa</td>\r\n<td>256 GB</td>\r\n</tr>\r\n<tr>\r\n<td>Tính năng camera</td>\r\n<td>Nhận diện khuôn mặt, Chuyên nghiệp (Pro), Tự động lấy nét (AF), Toàn cảnh (Panorama), Chạm lấy nét, Xoá phông, Quay chậm (Slow Motion), Trôi nhanh thời gian (Time Lapse), Làm đẹp</td>\r\n</tr>\r\n<tr>\r\n<td>Wifi</td>\r\n<td>Wi-Fi hotspot, Dual-band (2.4 GHz/5 GHz), Wi-Fi 802.11 a/b/g/n/ac</td>\r\n</tr>\r\n<tr>\r\n<td>Xem phim</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>SKU</td>\r\n<td>8414562088406</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div class=\"group\">\r\n<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">MÔ TẢ SẢN PHẨM</h4>\r\n<div class=\"content\">\r\n<div class=\"ToggleContent__Wrapper-sc-1hm81e2-1 iGyNLs\">\r\n<div class=\"ToggleContent__View-sc-1hm81e2-0 eIzUuC\">\r\n<div>\r\n<h5>Thiết kế thời thượng với mặt lưng chuyển đổi màu độc đáo</h5>\r\n<p><strong>Điện thoại Vivo Y12s</strong> được thiết kế theo phong cách hiện đại, nguyên khối, mặt lưng của máy được bo cong 2.5D, sắc màu gradient thời thượng, kết hợp với thân máy mỏng nhẹ tạo cảm giác thoải mái và cao cấp khi cầm trên tay.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/0a/08/20/d549fe78e053d418c0c6c7979eb48b25.jpg\" alt=\"\" width=\"750\" height=\"416\" /></p>\r\n<p>Trọng lượng máy nhẹ (chỉ khoảng 191 g) cùng với đó là khả năng chống bám mồ hôi và dấu vân tay tốt.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/5a/ff/ec/c4dd5adf1a7aed39669ea14a4148c8d1.jpg\" alt=\"\" width=\"750\" height=\"499\" /></p>\r\n<p>Máy được thiết kế với cảm biến vân tay tích hợp nút nguồn đặt ở cạnh bên, tối ưu hóa cho thao tác mở khóa với tốc độ chỉ 0.22 giây.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/2e/32/70/a2875df14667704732ff64f533b649fd.jpg\" alt=\"\" width=\"750\" height=\"416\" /></p>\r\n<p>Bên cạnh đó, Vivo Y12s cũng được trang bị nhận diện khuôn mặt mang đến cho người dùng một tùy chọn khác để mở khóa điện thoại trong tích tắc.</p>\r\n<h5>Màn hình tràn viền, sắc nét</h5>\r\n<p>Vivo Y12s được trang bị màn hình Halo tràn viền 6.51 inch, tỷ lệ khung hình 20:9 kết hợp với độ phân giải HD+ (720 x 1600 Pixels) cho tầm nhìn mở rộng, sống động hơn.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/76/2f/11/a3e9ddfa06dc92387d366b655d0217a4.jpg\" alt=\"\" width=\"750\" height=\"416\" /></p>\r\n<p>Cạnh viền siêu mỏng cho tỷ lệ màn hình trên thân máy lên đến 89%, mang đến trải nghiệm hình ảnh chất lượng, các thao tác bằng một tay trên màn hình đều hết sức dễ dàng.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/64/0a/6b/5810fdfd39c9359fe1e1e80717f99f37.jpg\" alt=\"\" width=\"750\" height=\"499\" /></p>\r\n<p>Ngoài ra, màn hình trên Vivo Y12s còn được tích hợp công nghệ In-cell mới nhất. Trong nhiều điều kiện sử dụng khác nhau như chơi game hay xem video thì màu sắc hiển thị đều rực rỡ và chi tiết, nhưng vẫn đảm bảo giảm lượng ánh sáng xanh có hại và bảo vệ thị lực của bạn.</p>\r\n<h5>Bộ đôi camera AI sắc nét</h5>\r\n<p>Vivo Y12s được trang bị bộ đôi camera có độ phân giải lần lượt là 13 MP và 2 MP tích hợp nhiều tính năng chụp ảnh, làm đẹp thông minh bao gồm nhận diện khuôn mặt, tự động lấy nét, giúp người dùng có thể ghi lại những bức ảnh thú vị hằng ngày một cách dễ dàng. </p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/c9/e8/33/3c3738bab5fe3ce3f0152c8bf2be0c9f.jpg\" alt=\"\" width=\"750\" height=\"416\" /></p>\r\n<p>Camera chính 13 MP, khẩu độ lớn f /2.2, chắc hẳn sẽ khiến bạn ngạc nhiên với độ chi tiết cao, tốc độ lấy nét nhanh trong điều kiện đủ sáng, kết hợp với các thuật toán cân chỉnh bằng thông minh, tự động nhận diện và cho ra bức ảnh tốt nhất với từng điều kiện chụp khác nhau.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/f5/80/06/3f4441f40c3df04441cebb849f4fc377.jpg\" alt=\"\" width=\"750\" height=\"499\" /></p>\r\n<p>Camera chân dung xóa phông với độ phân giải 2 MP, kết hợp với thuật toán AI mới nhất giúp làm mờ hậu cảnh một cách chính xác và tinh tế, mang đến bức ảnh chân dung có chiều sâu và chuyên nghiệp hơn.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/98/d5/8b/b9a07fe853994a5f20439663368e6484.jpg\" alt=\"\" width=\"750\" height=\"499\" /></p>\r\n<p>Camera trước của máy có độ phân giải 8 MP hỗ trợ cân chỉnh đường nét trên gương mặt, mang đến những tấm ảnh selfie lung linh để chia sẻ cùng người thân và gia đình.</p>\r\n<h5>Hiệu năng mạnh mẽ, đủ dùng cho các nhu cầu giải trí, chơi game hằng ngày</h5>\r\n<p>Vivo Y12s mang trong mình sức mạnh của con chip MediaTek Helio P35 với tốc độ xử lý lên đến 2.3 GHz, mượt mà giải trí, bung xõa với nhiều tác vụ.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/89/c6/54/962be0cf66f37f63a9452b5a6a49407e.jpg\" alt=\"\" width=\"750\" height=\"416\" /></p>\r\n<p>Đi kèm với đó là dung lượng RAM 3GB/4GB và bộ nhớ trong 32GB / 128GB cho phép bạn vận hành mượt mà nhiều tựa game, ứng dụng khác nhau.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/4f/3b/26/4d0fd79f7e15313870bd280a962db837.jpg\" alt=\"\" width=\"750\" height=\"499\" /></p>\r\n<p>Đồng thời, Y12s còn được trang bị 3 khe cắm thẻ nhớ, hỗ trợ mở rộng bộ nhớ lên đến 256 GB, giúp bạn dễ dàng lưu giữ những bài hát, bộ phim, hình ảnh và video yêu thích.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/8f/f2/c0/e6268377dff3a918904bfa68350d1f04.jpg\" alt=\"\" width=\"750\" height=\"416\" /></p>\r\n<p>Vivo Y12s còn mang đến những trải nghiệm chơi game chuyên nghiệp cho game thủ với chế độ Ultra-Game Mode, Rung 4D 2.0 cùng hàng loạt các chức năng tối ưu hóa hiệu năng, ngăn cửa sổ bật lên, chặn thông báo, cuộc gọi đến,úp bạn hoàn toàn tập trung và hòa mình vào không gian giải trí bất tận.</p>\r\n<h5>Thời lượng pin ấn tượng</h5>\r\n<p>Vivo Y12s trang bị dung lượng pin khủng 5000mAh đáp ứng được những nhu cầu sử dụng hằng ngày như học tập, giải trí, chơi</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/7a/49/0e/02a5b864f1f1f534d9f7bfd5277f06a1.jpg\" alt=\"\" width=\"750\" height=\"416\" /></p>\r\n<p>Ngoài ra Y21s còn trang bị chế độ tiết kiệm pin thông minh, giúp bạn có thể thoải mái xem phim HD lên đến 15 giờ hoặc chơi game liên tục suốt 9 giờ.</p>\r\n<p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Tuy nhiên tuỳ vào từng loại sản phẩm hoặc phương thức, địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, ...</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),('17',76,0,'6','<div class=\"warranty-item\"><span class=\"itemLeft\">Thời gian bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">12 Tháng</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Hình thức bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Điện tử</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành chính hãng</span></div>'),('18',85,0,'6','Điện thoại Vivo Y12s - Hàng Chính Hãng'),('19',75,0,'7','<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">THÔNG TIN CHI TIẾT</h4>\r\n<div class=\"group\">\r\n<div class=\"content has-table\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Dung lượng pin</td>\r\n<td>6000 mAh</td>\r\n</tr>\r\n<tr>\r\n<td>Bluetooth</td>\r\n<td>A2DP, LE</td>\r\n</tr>\r\n<tr>\r\n<td>Thương hiệu</td>\r\n<td>Xiaomi</td>\r\n</tr>\r\n<tr>\r\n<td>Camera sau</td>\r\n<td>Chính 48 MP &amp; Phụ 2 MP, 2 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Camera trước</td>\r\n<td>8 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ thẻ nhớ ngoài</td>\r\n<td>MicroSD</td>\r\n</tr>\r\n<tr>\r\n<td>Chip đồ họa (GPU)</td>\r\n<td>Adreno 610</td>\r\n</tr>\r\n<tr>\r\n<td>Chip set</td>\r\n<td>Snapdragon 662 8 nhân</td>\r\n</tr>\r\n<tr>\r\n<td>Tốc độ CPU</td>\r\n<td>4 nhân 2.0 GHz &amp; 4 nhân 1.8 GHz</td>\r\n</tr>\r\n<tr>\r\n<td>Loại/ Công nghệ màn hình</td>\r\n<td>IPS LCD</td>\r\n</tr>\r\n<tr>\r\n<td>FM radio</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>Ghi âm</td>\r\n<td>có</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ 4G</td>\r\n<td>có</td>\r\n</tr>\r\n<tr>\r\n<td>Phụ kiện đi kèm</td>\r\n<td>\r\n<p>Điện thoại, cáp sạc, củ sạc, sách hướng dẫn.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>Model</td>\r\n<td>Poco M3</td>\r\n</tr>\r\n<tr>\r\n<td>Jack tai nghe</td>\r\n<td>3.5mm</td>\r\n</tr>\r\n<tr>\r\n<td>Bộ nhớ khả dụng</td>\r\n<td>64gb</td>\r\n</tr>\r\n<tr>\r\n<td>Số sim</td>\r\n<td>2</td>\r\n</tr>\r\n<tr>\r\n<td>Loại pin</td>\r\n<td>Li-Po</td>\r\n</tr>\r\n<tr>\r\n<td>Loại Sim</td>\r\n<td>nano sim</td>\r\n</tr>\r\n<tr>\r\n<td>Chất liệu</td>\r\n<td>Khung &amp; Mặt lưng nhựa</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ</td>\r\n<td>Trung Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Cổng sạc</td>\r\n<td>USB Type-C</td>\r\n</tr>\r\n<tr>\r\n<td>Trọng lượng</td>\r\n<td>200g</td>\r\n</tr>\r\n<tr>\r\n<td>RAM</td>\r\n<td>6GB</td>\r\n</tr>\r\n<tr>\r\n<td>Độ phân giải</td>\r\n<td>Full HD+ (1080 x 2340 Pixels)</td>\r\n</tr>\r\n<tr>\r\n<td>ROM</td>\r\n<td>64GB/128GB</td>\r\n</tr>\r\n<tr>\r\n<td>Kích thước màn hình</td>\r\n<td>6.53 inch</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ thẻ tối đa</td>\r\n<td>256gb</td>\r\n</tr>\r\n<tr>\r\n<td>Tính năng camera</td>\r\n<td>Lấy nét theo pha (PDAF) Xoá phông Toàn cảnh (Panorama) Siêu cận (Macro) Góc rộng (Wide) HDR</td>\r\n</tr>\r\n<tr>\r\n<td>Wifi</td>\r\n<td>Wi-Fi hotspot Dual-band (2.4 GHz/5 GHz) Wi-Fi Direct Wi-Fi 802.11 a/b/g/n/ac</td>\r\n</tr>\r\n<tr>\r\n<td>SKU</td>\r\n<td>3480951345125</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div class=\"group\">\r\n<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">MÔ TẢ SẢN PHẨM</h4>\r\n<div class=\"content\">\r\n<div class=\"ToggleContent__Wrapper-sc-1hm81e2-1 iGyNLs\">\r\n<div class=\"ToggleContent__View-sc-1hm81e2-0 eIzUuC\">\r\n<div>\r\n<p>Tuy nằm ở phân khúc giá rẻ, nhưng Xiaomi POCO M3 được chăm chút kỹ lưỡng từ thiết kế trẻ trung, hiệu năng mạnh mẽ đáp ứng tốt nhu cầu giải trí hàng ngày cùng hệ thống camera đủ dùng khiến thiết bị trở thành sự lựa chọn phù hợp của mọi đối tượng.<br />Thiết kế độc đáo, bắt mắt</p>\r\n<p>Ngay từ cái nhìn đầu tiên, ngoại hình của Xiaomi POCO M3 thật sự rất nổi bật so với các mẫu thiết kế bình dân nhàm chán khác. Sở hữu thiết kế nguyên khối, phần khung viền và mặt sau cùng một tông màu chủ đạo mang lại cảm giác thống nhất tổng thể.</p>\r\n<p>Mặc dù mặt lưng không được làm từ kim loại bóng bẩy, nhưng trông nó không hề “rẻ tiền” chút nào. Lớp vỏ nhựa kết cấu vân sần đẹp mắt, chống bám vân tay với điểm nhấn môđun camera được bố trí ở mặt kính bên trái, kết hợp logo POCO nằm ở phía đối diện giúp máy đạt được sự cân bằng trực quan.</p>\r\n<p>Ở cạnh phải của thiết bị là phím chỉnh âm lượng và phím nguồn tích hợp cảm biến vân tay cho kết quả hoạt động nhanh, chính xác, mang lại sự thoải mái khi sử dụng. Trong khi phía bên trái chỉ có một khe cắm thẻ nano SIM kép và thẻ nhớ lên đến 512 GB.</p>\r\n<p> </p>\r\n<p>Xiaomi POCO M3 sở hữu hệ thống loa kép đạt chứng nhận Hi-Res Audio cho chất lượng tuyệt vời cho dù bạn nghe nhạc hay xem video. Ngoài ra máy vẫn được trang bị jack cắm tai nghe 3.5 mm tiêu chuẩn.</p>\r\n<p>Tỷ lệ giữa màn hình và thân máy được kiểm soát tốt mà không để lại phần cằm quá dày gây khó chịu, viền màn hình các cạnh tương đối mỏng. Xiaomi POCO M3 sử dụng thiết kế màn hình giọt nước để chứa camera selfie. Với trọng lượng chưa đến 200g  điện thoại cho cảm giác cầm nắm chắc chắn thoải mái.</p>\r\n<p>Xiaomi POCO M3 được trang bị tấm nền IPS LCD kích thước 6.53 inch, khá lớn theo tiêu chuẩn smartphone hiện đại, hỗ trợ tần số quét 60 Hz, độ phân giải Full HD+ và mật độ điểm ảnh là 395 ppi, hứa hẹn mang đến trải nghiệm hình ảnh sống động, chân thật.</p>\r\n<p>Ngoài ra màn hình của POCO M3 còn đạt chứng nhận màn hình phát ra ánh sáng xanh thấp bởi TÜV Rheinland giúp bảo vệ mắt khi sử dụng, hạn chế gây mỏi mắt. </p>\r\n<p>Mặt trước được trang bị kính cường lực Gorilla Glass 3 có độ bền cao, đóng vai trò bảo vệ thiết bị khỏi những cú va đập trong đời sống hàng ngày.</p>\r\n<p>Sức mạnh vượt xa mong đợi</p>\r\n<p>Xiaomi POCO M3 được trang bị bộ vi xử lý Snapdragon 662 được sản xuất trên tiến trình 11 nm, bao gồm 8 lõi Kryo 260 trong đó 4 lõi hoạt động ở tốc độ 2.0 GHz và 4 lõi tiết kiệm năng lượng hơn với tần số xung nhịp là 1.8 GHz. Ngoài ra, công cụ AI thế hệ thứ ba cung cấp hiệu suất tính toán được cải thiện đáng kể.</p>\r\n<p>Cùng với CPU, chịu trách nhiệm về đồ họa là GPU Adreno 610 cho hiệu suất khá tốt khi chơi các game phổ biến ở cấu hình phù hợp.</p>\r\n<p>Xiaomi POCO M3 cung cấp không gian lưu trữ lớn, trong đó có RAM LPDDR4X dung lượng 4 GB cho tốc độ nhanh, mượt, khả năng đa nhiệm tốt và bộ nhớ trong 128 GB chuẩn UFS 2.2 cho tốc độ nhanh hơn rất nhiều so với chuẩn eMMC, giảm thời gian mở ứng dụng một cách hiệu quả.</p>\r\n<p>Giờ đây, bạn có thể thỏa thích lưu trữ ảnh cũng như video, các tệp tải xuống, bộ phim yêu thích mà không lo giới hạn bởi dung lượng lưu trữ. Ngoài ra, máy cũng hỗ trợ mở rộng dung lượng lưu trữ thông qua thẻ nhớ microSD lên đến 512 GB.</p>\r\n<p>Thiết bị được cài đặt sẵn giao diện tùy chỉnh MIUI 12 dựa trên hệ điều hành Android 10, với nhiều cải tiến như: Tích hợp hệ thống điều hướng bằng cử chỉ, các tùy chọn mới để hiển thị nhiều màn hình và đa nhiệm tốt hơn, tính năng bảo mật Flare, Barbed Wire và Mask System, tính năng theo dõi sức khỏe,…</p>\r\n<p>Hệ thống camera ấn tượng</p>\r\n<p>Camera selfie ở khu vực “giọt nước” của máy có độ phân giải 8 MP, đầy đủ các tính năng để bạn thỏa thích “sống ảo” như: Chụp ảnh tự sướng hẹn giờ, chế độ ảnh chân dung, cùng các bộ lọc và công cụ làm đẹp AI khác.</p>\r\n<p>Hơn thế nữa, xu hướng quay video Time Lapse nay cũng đã xuất hiện trên camera trước, mọi thứ dường như quá dễ dàng, bạn chỉ việc nhấc máy lên và tự do sáng tạo những video cho riêng mình.</p>\r\n<p>Trong số 3 camera “hầm hố” ở mặt sau, camera chính gây ấn tượng nhất nhờ độ phân giải cao 48 MP, trong điều kiện ánh sáng tốt, hình ảnh chụp được có độ sắc nét cao với dải động màu sắc tốt. Đặc biệt, nhờ thuật toán AI thông minh, chế độ chụp ảnh ban đêm đem đến các bức ảnh có độ chi tiết cao nhờ khả năng kiểm soát ánh sáng.  </p>\r\n<p>Khám phá thế giới rộng lớn theo một góc nhìn hoàn toàn mới với sự trợ giúp của ống kính macro 2 MP khẩu độ f/2.4, bạn có thể nhìn kỹ hơn vào vẻ đẹp của những thứ nhỏ nhất. Bên cạnh đó, cảm biến độ sâu 2 MP cho phép bạn chụp những bức ảnh chân dung xóa phông trông tự nhiên hơn bao giờ hết.</p>\r\n<p>Cụm camera sau của Xiaomi POCO M3 còn hỗ trợ nhiều tính năng như: Chụp ảnh định dạng RAW mới, chế độ toàn cảnh, AI Beautify, AI Scene Detection,…</p>\r\n<p>Dễ dàng lưu giữ những thước phim đáng nhớ với tính năng quay video chuyển động chậm (Slow motion) ở tốc độ 120 khung hình / giây và video chất lượng 1080p ở tốc độ 30 khung hình / giây.</p>\r\n<p>Trải nghiệm ngày dài</p>\r\n<p>Xiaomi POCO M3 sở hữu viên pin 6000 mAh ấn tượng. Cụ thể máy cho phép gọi điện thoại liên tục 40 giờ, 196 giờ tận hưởng nghe nhạc và 17 giờ giải trí video.</p>\r\n<p>Trong buổi ra mắt sản phẩm, hãng công bố tuổi thọ pin khá cao khi đạt đến 1.000 lần sạc, có nghĩa là tuổi thọ của điện thoại vượt quá 2.5 năm mà không có bất kỳ sự suy giảm đáng kể nào của pin. Nhờ thiết kế thông minh và an toàn ở nhiệt độ 25 độ C và 45 độ C, thời lượng pin lần lượt dài hơn 25% và 20% so với các điện thoại thông minh khác.</p>\r\n<p>Ngoài ra, bạn có thể nhanh chóng “nạp nhiên liệu” cho máy trong nháy mắt nhờ tính năng sạc nhanh 22.5 W. Thật tiện lợi nếu cần phải di chuyển ra ngoài gấp nhưng điện thoại lại gần hết pin, chỉ với bộ sạc nhanh đi kèm, mọi thứ sẽ được giải quyết.</p>\r\n<p>Xu hướng chọn mua điện thoại tầm trung thay vì cao cấp ngày càng phổ biến trên thị trường Việt Nam. Xiaomi POCO M3 vượt ngoài mong đợi khi đem đến những giá trị tương xứng với số tiền khách hàng bỏ ra, từ thiết kế hợp thời đến các chức năng cao cấp. Xiaomi POCO M3 hoàn toàn xứng đáng là thiết bị giá rẻ không thể bỏ qua trong năm nay. </p>\r\n<p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Tuy nhiên tuỳ vào từng loại sản phẩm hoặc phương thức, địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, ...</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),('20',76,0,'7','<div class=\"warranty-item\"><span class=\"itemLeft\">Thời gian bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">18 Tháng</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Hình thức bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Hóa đơn</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành chính hãng</span></div>'),('21',85,0,'7','Điện thoại Xiaomi POCO M3 - HÀNG CHÍNH HÃNG'),('22',75,0,'8','<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">THÔNG TIN CHI TIẾT</h4>\r\n<div class=\"group\">\r\n<div