Có</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ</td>\r\n<td>Trung Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Pin có thể tháo rời</td>\r\n<td>Không</td>\r\n</tr>\r\n<tr>\r\n<td>Cổng sạc</td>\r\n<td>Lightning</td>\r\n</tr>\r\n<tr>\r\n<td>Trọng lượng</td>\r\n<td>228g</td>\r\n</tr>\r\n<tr>\r\n<td>Quay phim</td>\r\n<td>Trước: 4K@24/30/60fps, 1080p@30/60/120fps, gyro-EIS; Sau: 4K@24/30/60fps, 1080p@30/60/120/240fps, HDR, Dolby Vision HDR (up to 60fps), stereo sound rec.</td>\r\n</tr>\r\n<tr>\r\n<td>Độ phân giải</td>\r\n<td>1284 x 2778 pixels</td>\r\n</tr>\r\n<tr>\r\n<td>ROM</td>\r\n<td>Tùy chọn 128GB/256GB/512GB</td>\r\n</tr>\r\n<tr>\r\n<td>Kích thước màn hình</td>\r\n<td>6.7 inch</td>\r\n</tr>\r\n<tr>\r\n<td>Video call</td>\r\n<td>Thông qua ứng dụng thứ 3</td>\r\n</tr>\r\n<tr>\r\n<td>Wifi</td>\r\n<td>Wi-Fi 802.11 a/b/g/n/ac/6, dual-band, hotspot</td>\r\n</tr>\r\n<tr>\r\n<td>Xem phim</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>SKU</td>\r\n<td>6268800138291</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div class=\"group\">\r\n<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">MÔ TẢ SẢN PHẨM</h4>\r\n<div class=\"content\">\r\n<div class=\"ToggleContent__Wrapper-sc-1hm81e2-1 iGyNLs\">\r\n<div class=\"ToggleContent__View-sc-1hm81e2-0 eIzUuC\">\r\n<div>Hàng chính hãng VN/A<br />Bộ nhớ trong 128 GB<br />Loại SIM Dual SIM (nano‑SIM and eSIM)<br />Loại màn hình Super Retina XDR OLED, HDR10, Dolby Vision, Wide color gamut, True-tone<br />Kích thước màn hình 6.7 inches<br />Độ phân giải màn hình 1284 x 2778 pixels<br />Hệ điều hành iOS<br />Phiên bản hệ điều hành iOS 14\r\n<h5>iPhone 12 Pro Max 128GB - Nâng tầm đẳng cấp sử dụng</h5>\r\n<p>Ngày 14/10 vừa qua, Apple đã trình làng iPhone 12 với các phiên bản làm điên đảo các tín đồ của nhà Táo. Apple năm nay lại ra thêm một chiếc iPhone mới với tên gọi mới là <strong>iPhone 12 Pro Max 128GB</strong>, đây là một dòng điện thoại mới và mạnh mẽ nhất của nhà Apple năm nay. Với thiết kế nguyên khối vuông vắn cùng nhiều màu sắc đẹp mắt hứa hẹn sẽ mang đến trải nghiệm thú vị cho người dùng.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/ba/99/ec/54c6678097a55e7db04768bda9f8e01c.jpg\" alt=\"\" width=\"750\" height=\"605\" /></p>\r\n<h5>Màn hình 6.7 inches Super Retina XDR</h5>\r\n<p>Năm nay, công nghệ màn hình trên 12 Pro Max cũng được đổi mới và trang bị tốt hơn cùng kích thước lên đến 6.7 inch, lớn hơn nhiều so với điện thoại iPhone 12 Mini. Với công nghệ màn hình OLED cho khả năng hiển thị hình ảnh lên đến 2778 x 1284 pixels. Bên cạnh đó, màn hình này còn cho độ sáng tối đa cao nhất lên đến 800 nits, luôn đảm bảo cho bạn một độ sáng cao và dễ nhìn nhất ngoài nắng.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/f6/ac/04/a53002a0e8fbc23a5c144e1d7b66e253.jpg\" alt=\"\" width=\"750\" height=\"405\" /></p>\r\n<p>Một điểm đổi mới nữa trên màn hình của chiếc điện thoại iPhone 12 năm nay là việc chúng được thiết kế với khung viền vuông vức, viền thép không gỉ mang đến vẻ đẹp sang trọng cho điện thoại. Máy cũng được trang bị nhiều phiên bản màu sắc đặc biệt cho người dùng lựa chọn.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/bb/df/1a/f05bec2a66b46763f689b31cb51563be.jpg\" alt=\"\" width=\"750\" height=\"590\" /></p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/60/8c/45/6740f45ee9c1650c94d33edc8c8f6384.jpg\" alt=\"\" width=\"750\" height=\"195\" /></p>\r\n<h5>RAM 6GB đa nhiệm thoải mái, bộ nhớ trong dung lượng lớn</h5>\r\n<p>Về trang bị phần cứng bên trong thì iPhone 12 Pro Max có một thanh RAM lên đến 6GB. Điều này cho thấy rằng Apple ngày đang lắng nghe người dùng nhiều hơn khi trang bị một dung lượng RAM lớn hơn để việc đa nhiệm ngày càng được cải thiện hơn. Việc thanh ram lớn giúp cho bạn trải nghiệm các tựa game và đa nhiệm mượt mà hơn.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/42/b3/43/8b7d84fae5fc26d9d9b776c832513746.jpg\" alt=\"\" width=\"750\" height=\"565\" /></p>\r\n<p>Năm nay, 12 Pro Max cũng sẽ có ba phiên bản bộ nhớ trong khác nhau, với bộ nhớ trong nhỏ nhất bắt đầu từ 128GB, 256GB và cao nhất sẽ là 512GB. Một chiếc điện thoại mà có một bộ nhớ trong lớn ngang ngửa một chiếc laptop là điều mà Apple muốn mang lại cho người dùng để có thể san sẻ bớt bộ nhớ cho các thiết bị khác.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/75/f6/8c/3a07f6accb6e22234b85a696d6526292.jpg\" alt=\"\" width=\"750\" height=\"473\" /></p>\r\n<h5>Chip Apple A14 SoC 5nm</h5>\r\n<p>iPhone 12 Pro Max không những chỉ có các cải tiến trên, mà chúng còn có một thứ cải tiến được coi là nguồn lõi và là trái tim để vận hành chiếc điện thoại siêu phẩm 2020, đó là con chip Apple A14 SoC 5nm. Trang bị này giúp cho điện thoại có một sức mạnh đáng gờm hơn các đối thủ hơn về hiệu năng, hiệu suất sử dụng pin.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/42/b3/43/8b7d84fae5fc26d9d9b776c832513746.jpg\" alt=\"\" width=\"750\" height=\"568\" /></p>\r\n<h5>Khả năng kết nối 5G hiện đại</h5>\r\n<p>Kết nối 5G hiện đại được trang bị trên điện thoại iPhone 12 Pro Max là một bước tiến mới trong kết nối và phát triển mạng lưới truyền tải thông tin. Chúng giúp cho bạn có thể cải thiện hiệu suất sử dụng mạng và chúng còn giúp các đường truyền tín hiệu luôn được đảm bảo không rớt kết nối và tăng chất lượng hiển thị hình ảnh trên mạng.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/c3/c7/3f/0cf33f2018e1dba6e6f3cb44952686ab.jpg\" alt=\"\" width=\"750\" height=\"480\" /></p>\r\n<h5>Cụm 3 camera sau với độ phân giải 12MP</h5>\r\n<p>Có thể nói camera cũng là một bước tiến mới trên iPhone 12 Pro Max khi chúng có một bộ 3 camera với chung một độ phân giải là 12MP. Tuy nhiên chúng có khẩu độ lớn và mật độ điểm ảnh trên một panel cũng lớn hơn, do đó chúng cho hình ảnh chi tiết hơn, bắt sáng tốt hơn. Ngoài ra, kết hợp chống rung quang học OIS thì máy còn có thể quay phim 4K tốt.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/6f/8d/f6/4193ec3f44001c146d571bc3eb042d5a.jpg\" alt=\"\" width=\"750\" height=\"395\" /></p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/db/72/88/2b4baf1b93b08b5c415fbfe76705e360.jpg\" alt=\"\" width=\"750\" height=\"393\" /></p>\r\n<p>Camera trên iPhone 12 Pro Max có chức năng quét chiều sâu và đảm bảo hình ảnh có một độ sâu nhất định. Cùng với đó chức năng chính của chiếc ống kính này là khả năng thể hiện hình ảnh 3D khi quét chúng vào một căn phòng nhất định. Giúp phục vụ cho công việc xây dựng cũng như định dạng hình ảnh trước khi xây.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/2c/f6/bd/e11f19a54e9cc5ed409f02d117b83367.jpg\" alt=\"\" width=\"750\" height=\"451\" /></p>\r\n<h5>Camera trước 12MP hỗ trợ mở FaceID cùng công nghệ chống nước IP68</h5>\r\n<p>Camera trước 12MP cũng có cùng khẩu độ và kích thước điểm ảnh trong panel giống như camera. Điều này giúp cho việc sử dụng chúng cho chụp ảnh selfie tốt hơn và chân thực hơn. Cùng với đó một tính năng mà Apple luôn giữ chúng từ đời iPhone X đến giờ là khả năng quét khuôn mặt 3D FaceiD.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/7c/f5/f9/97347a2dc6597bcc27098b343182cc31.jpg\" alt=\"\" width=\"750\" height=\"455\" /></p>\r\n<p>Công nghệ chống nước là không thể thiếu trên các dòng điện thoại cao cấp và đặc biệt là đối với iPhone 12 Pro Max. Chúng được trang bị công nghệ chống nước và chống bụi tốt nhất hiện nay trên các dòng smartphone đó là tiêu chuẩn IP68. Giúp bạn luôn có thể yên tâm hơn trong việc sử dụng quay phim dưới nước hay ở môi trường khắc nghiệt.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/7f/d1/d1/149d1ff82838682a1070788c20351a12.jpg\" alt=\"\" width=\"750\" height=\"456\" /></p>\r\n<h5>Pin liền cho thời lượng sử dụng lên đến cả ngày cùng công nghệ sạc nhanh</h5>\r\n<p>Một viên pin liền với dung lượng lớn trên iPhone 12 Pro Max giúp cho chiếc điện thoại bạn có thể hoạt động được một cách ổn thoả hơn và thời gian sử dụng được lâu dài hơn. Cụ thể, máy cho thời gian nghe nhạc lên tới 80 giờ hoặc 12 giờ xem video trực truyến.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/15/26/93/17968a0f7f8261886b8d6e2e6e401e86.jpg\" alt=\"\" width=\"750\" height=\"146\" /></p>\r\n<p>Công nghệ sạc là trên 12 Pro Max là công nghệ sạc nhanh không dây lên đến 15W. Điều này có thể giúp bạn hạn chế được các việc phải ngồi đợi chiếc điện thoại của mình sạc xong khi máy có thể bổ sung 50% dung lượng chỉ trong vòng 30 phút.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/61/2f/29/16bdce0599af7c5a19aaba3d5c0427ea.jpg\" alt=\"\" width=\"750\" height=\"885\" /></p>\r\n<p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Tuy nhiên tuỳ vào từng loại sản phẩm hoặc phương thức, địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, ...</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),('23',76,0,'8','<div class=\"warranty-item\"><span class=\"itemLeft\">Thời gian bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">12 Tháng</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Hình thức bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Điện tử</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành chính hãng</span></div>'),('24',85,0,'8','Điện Thoại iPhone 12 Pro Max 128GB - Hàng Chính Hãng'),('25',75,0,'9','<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">THÔNG TIN CHI TIẾT</h4>\r\n<div class=\"group\">\r\n<div class=\"content has-table\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Dung lượng pin</td>\r\n<td>4030 mAh</td>\r\n</tr>\r\n<tr>\r\n<td>Thương hiệu</td>\r\n<td>Vivo</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ thương hiệu</td>\r\n<td>Trung Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Camera sau</td>\r\n<td>13 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Camera trước</td>\r\n<td>5 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Loại/ Công nghệ màn hình</td>\r\n<td>IPS LCD, 6.22\", HD+</td>\r\n</tr>\r\n<tr>\r\n<td>FM radio</td>\r\n<td>Không</td>\r\n</tr>\r\n<tr>\r\n<td>Phụ kiện đi kèm</td>\r\n<td>\r\n<p><a class=\"stdImg\">Sạc, Sách hướng dẫn, Hộp, Cây lấy sim, Ốp lưng, Cáp</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>Số sim</td>\r\n<td>2</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ</td>\r\n<td>Trung Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Trọng lượng</td>\r\n<td>161 g</td>\r\n</tr>\r\n<tr>\r\n<td>RAM</td>\r\n<td>2</td>\r\n</tr>\r\n<tr>\r\n<td>ROM</td>\r\n<td>32</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ thẻ tối đa</td>\r\n<td>256 GB</td>\r\n</tr>\r\n<tr>\r\n<td>SKU</td>\r\n<td>5901322165369</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div class=\"group\">\r\n<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">MÔ TẢ SẢN PHẨM</h4>\r\n<div class=\"content\">\r\n<div class=\"ToggleContent__Wrapper-sc-1hm81e2-1 iGyNLs\">\r\n<div class=\"ToggleContent__View-sc-1hm81e2-0 eIzUuC\">\r\n<div>Màn hình: IPS LCD, 6.22\", HD+<br />Hệ điều hành: Android 10<br />Camera sau: 13 MP<br />Camera trước: 5 MP<br />CPU: MediaTek Helio P35 8 nhân<br />RAM: 2 GB<br />Bộ nhớ trong: 32 GB<br />Thẻ nhớ: MicroSD, hỗ trợ tối đa 256 GB<br />Thẻ SIM:<br />2 Nano SIM, Hỗ trợ 4G<br />Dung lượng pin: 4030 mAh\r\n<h2 dir=\"ltr\">Vivo vừa trình làng chiếc điện thoại mới mang tên Vivo Y1s hướng tới nhóm khách hàng phổ thông đang tìm kiếm một sản phẩm có giá thành tốt, nhiều tính năng hấp dẫn, đáp ứng tốt nhu cầu liên lạc, học tập làm việc một cách dễ dàng. </h2>\r\n<h3 dir=\"ltr\">Màn hình giải trí chất lượng tốt</h3>\r\n<p dir=\"ltr\">Vivo Y1s được trang bị màn hình lớn kích thước 6.22 inch sử dụng tấm nền IPS LCD cho góc nhìn tốt, độ sáng cao, dễ dàng thao tác dưới nhiều điều kiện ánh sáng khác nhau.</p>\r\n<p dir=\"ltr\">Màn hình này có độ phân giải HD+ (720 x 1520 Pixels) vừa đủ để mang tới những trải nghiệm hình ảnh sống động, tuyệt vời.</p>\r\n<p dir=\"ltr\"> </p>\r\n<p dir=\"ltr\">Đồng thời, màn hình trên Vivo Y1s còn được nhà sản xuất tinh tế vát cong nhẹ 2.5D mang tới trải nghiệm cầm nắm, vuốt và thao tác cực kỳ thích.</p>\r\n<p dir=\"ltr\"> </p>\r\n<p dir=\"ltr\">Máy có thiết kế nhựa nguyên khối được đem đến trọng lượng vô cùng nhẹ chỉ 161 gram kết hợp cùng các cạnh góc của Vivo Y93 được bo tròn trông mềm mại và quyến rũ điều này giúp người dùng khi cầm nắm cảm thấy thoải mái hơn.</p>\r\n<p dir=\"ltr\"> </p>\r\n<h3 dir=\"ltr\">Camera chụp ảnh tốt </h3>\r\n<p dir=\"ltr\">Camera chính 13 MP được tích hợp công nghệ nhận diện AI cùng hàng loạt các tính năng làm đẹp thông minh hứa hẹn sẽ mang tới cho người dùng chất lượng hình ảnh tốt nhất.</p>\r\n<p dir=\"ltr\"> </p>\r\n<p dir=\"ltr\">Phía trước là camera selfie 5 MP đáp ứng tốt nhu cầu chụp ảnh hay gọi video một cách dễ dàng với chất lượng cao.</p>\r\n<p dir=\"ltr\"> </p>\r\n<p dir=\"ltr\">Tuy chỉ là điện thoại giá rẻ nhưng Vivo Y1s vẫn được trang bị chức năng bảo mật mở bằng khuôn mặt vô cùng tiện lợi và chính xác.</p>\r\n<p dir=\"ltr\"> </p>\r\n<h3 dir=\"ltr\">Hiệu năng tốt trong tầm giá</h3>\r\n<p dir=\"ltr\">Vivo Y1s được trang bị vi xử lý 8 nhân Helio P35 tuy hiệu năng không quá cao nhưng về cơ bản vẫn đảm bảo các tác vụ hằng ngày vẫn rất mượt mà và chơi được một số tựa game với mức cài đặt cấu hình đơn giản. </p>\r\n<p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Tuy nhiên tuỳ vào từng loại sản phẩm hoặc phương thức, địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, ...</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),('26',76,0,'9','<div class=\"warranty-item\"><span class=\"itemLeft\">Thời gian bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">12 Tháng</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Hình thức bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Điện tử</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành chính hãng</span></div>'),('27',85,0,'9','Điện thoại Vivo Y1S - Hàng chính hãng'),('28',75,0,'10','<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">THÔNG TIN CHI TIẾT</h4>\r\n<div class=\"group\">\r\n<div class=\"content has-table\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Dung lượng pin</td>\r\n<td>4000mAh</td>\r\n</tr>\r\n<tr>\r\n<td>Bluetooth</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>Thương hiệu</td>\r\n<td>Nokia</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ thương hiệu</td>\r\n<td>Phần Lan</td>\r\n</tr>\r\n<tr>\r\n<td>Kết nối dữ liệu</td>\r\n<td>2G, 3G, 4G, Bluetooth, Wifi</td>\r\n</tr>\r\n<tr>\r\n<td>Đèn Flash</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>Loại/ Công nghệ màn hình</td>\r\n<td>IPS LCD</td>\r\n</tr>\r\n<tr>\r\n<td>FM radio</td>\r\n<td>Không</td>\r\n</tr>\r\n<tr>\r\n<td>Phụ kiện đi kèm</td>\r\n<td>Sách HDSD nhanh, Sạc, Cáp USB Type-C, Khóa mở SIM, Ốp Silicon, Tai nghe</td>\r\n</tr>\r\n<tr>\r\n<td>Model</td>\r\n<td>3</td>\r\n</tr>\r\n<tr>\r\n<td>Jack tai nghe</td>\r\n<td>3.5mm</td>\r\n</tr>\r\n<tr>\r\n<td>Số sim</td>\r\n<td>2</td>\r\n</tr>\r\n<tr>\r\n<td>Loại Sim</td>\r\n<td>Nano Sim</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ</td>\r\n<td>Trung Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Cổng sạc</td>\r\n<td>Micro USB</td>\r\n</tr>\r\n<tr>\r\n<td>RAM</td>\r\n<td>4 GB</td>\r\n</tr>\r\n<tr>\r\n<td>Độ phân giải</td>\r\n<td>1440 x 720 pixels</td>\r\n</tr>\r\n<tr>\r\n<td>ROM</td>\r\n<td>64GB</td>\r\n</tr>\r\n<tr>\r\n<td>Kích thước màn hình</td>\r\n<td>6.39 inch</td>\r\n</tr>\r\n<tr>\r\n<td>Wifi</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>SKU</td>\r\n<td>7735641375288</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div class=\"group\">\r\n<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">MÔ TẢ SẢN PHẨM</h4>\r\n<div class=\"content\">\r\n<div class=\"ToggleContent__Wrapper-sc-1hm81e2-1 iGyNLs\">\r\n<div class=\"ToggleContent__View-sc-1hm81e2-0 eIzUuC\">\r\n<div>\r\n<h5>Thiết kế nhỏ gọn và màn hình IPS LCD 6.39 inch</h5>\r\n<p><strong>Điện thoại Nokia 3.4</strong> là mẫu smartphone tầm trung đến từ thương hiệu Nokia nổi tiếng. Chiếc điện thoại này có thiết kế gọn nhẹ vì được làm từ chất liệu nhựa. Khi cầm nắm sẽ cho người dùng cảm giác thoải mái vì không quá nặng tay.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/d8/78/0b/6cec028d04dfd4f5267dfd1626b5af8e.jpg\" alt=\"Điện Thoại Nokia 3.4 - Hàng Chính Hãng\" width=\"750\" height=\"845\" /></p>\r\n<p>Màn hình của Nokia 3.4 có kích thước 6.39 inch và được tạo nên từ tấm nền IPS LCD, với kích thước màn hình này sẽ đảm bảo hình ảnh được hiển thị chi tiết, dễ dàng quan sát. Tấm nền IPS giúp mang đến hình ảnh sắc nét, màu sắc hài hòa và sinh động.</p>\r\n<h5>Trang bị chip Snapdragon 460, RAM 4GB và 64GB bộ nhớ trong</h5>\r\n<p>Chip được trang bị cho Nokia 3.4 là Snapdragon 460, đây là loại chip được dùng rất phổ biến cho những dòng smartphone tầm trung với khả năng xử lí ổn định, đảm bảo nhanh chóng đối với các tác vụ thông thường. Vì đây là một chiếc điện thoại tầm trung và dùng chip Snapdragon 460 nên sẽ không hỗ trợ tốt với những loại game hay ứng dụng nặng.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/ee/0e/2b/86dd70d0cbcd7c710b96a2850550b0d8.jpg\" alt=\"Điện Thoại Nokia 3.4 - Hàng Chính Hãng\" width=\"750\" height=\"1020\" /></p>\r\n<p>Ngoài ra, Nokia 3.4 có RAM 4GB và ROM là 64GB, mức dung lượng này sẽ đáp ứng tốt nhu cầu lưu trữ thông thường như hình ảnh, video clip và các ứng dụng đơn giản. Nhưng bù lại, máy sẽ hỗ trợ thẻ micro SD lên đến 400GB.</p>\r\n<h5>Camera sau 13MP + 2MP + 5MP, camera selfie 8MP và hỗ trợ sim kép</h5>\r\n<p>Với Nokia 3.4, điện thoại được trang bị 3 camera với độ phân giải lần lượt là 13MP và 2MP, 5MP. Ngoài ra camera này còn có tính năng như chụp liên tục, nhận diện khuôn mặt, HDR, chạm lấy nét. Với độ phân giải 13MP, điện thoại có thể chụp được những bức ảnh với chất lượng tốt, sắc nét và tươi sáng. Camera selfie 5MP, đủ để cho ra những bức ảnh selfie chất lượng, chân thực.</p>\r\n<p>Ngoài ra, Nokia 3.4 là chiếc smartphone hỗ trợ sim kép, chính vì thế, bạn có thể dùng 2 sim chỉ trong một chiếc điện thoại. Điều này sẽ rất tiện lợi khi liên lạc, nhất là với những ai cần liên hệ với nhiều người trong ngày, có thể luân phiên sử dụng một trong hai sim và có thể dùng hai sim của hai nhà mạng khác nhau để nhận được những ưu đãi khác nhau.</p>\r\n<h5>Pin 4000 mAh cho thời gian đàm thoại 35 giờ cùng bảo mật vân tay</h5>\r\n<p>Pin của Nokia 3.4 được xếp vào hàng “khủng” bởi dung lượng lên đến 4000 mAh, cho khả năng đàm thoại lên đến 35 giờ. Người dùng thậm chí có thể sử dụng đến vài ngày nếu chỉ dùng những chức năng cơ bản.</p>\r\n<p>Ngoài ra, Nokia 3.4 sở hữu bảo mật bằng vân tay,điều này không chỉ tiện lợi hơn khi mở khóa điện thoại mà còn giúp khả năng bảo vệ thông tin và dữ liệu trong điện thoại của bạn được tốt hơn. Bạn sẽ không còn gặp tình trạng quên mất mật khẩu điện thoại nữa.</p>\r\n<p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Tuy nhiên tuỳ vào từng loại sản phẩm hoặc phương thức, địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, ...</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),('29',76,0,'10','<div class=\"warranty-item\"><span class=\"itemLeft\">Thời gian bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">12 Tháng</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Hình thức bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Điện tử</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành chính hãng</span></div>'),('30',85,0,'10','Điện Thoại Nokia 3.4 - Hàng Chính Hãng'),('31',75,0,'11','<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">THÔNG TIN CHI TIẾT</h4>\r\n<div class=\"group\">\r\n<div class=\"content has-table\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Dung lượng pin</td>\r\n<td>5160 mAh</td>\r\n</tr>\r\n<tr>\r\n<td>Bluetooth</td>\r\n<td>A2DP/ v5.0/ LE</td>\r\n</tr>\r\n<tr>\r\n<td>Thương hiệu</td>\r\n<td>Xiaomi</td>\r\n</tr>\r\n<tr>\r\n<td>Camera sau</td>\r\n<td>Chính 48 MP &amp; Phụ 8 MP, 2 MP, 2 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Camera trước</td>\r\n<td>20 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ thẻ nhớ ngoài</td>\r\n<td>MicroSD</td>\r\n</tr>\r\n<tr>\r\n<td>Chip đồ họa (GPU)</td>\r\n<td>Adreno 640</td>\r\n</tr>\r\n<tr>\r\n<td>Chip set</td>\r\n<td>Snapdragon 860 8 nhân</td>\r\n</tr>\r\n<tr>\r\n<td>Tốc độ CPU</td>\r\n<td>1 nhân 2.96 GHz, 3 nhân 2.42 GHz &amp; 4 nhân 1.8 GHz</td>\r\n</tr>\r\n<tr>\r\n<td>Kết nối dữ liệu</td>\r\n<td>4G</td>\r\n</tr>\r\n<tr>\r\n<td>Loại/ Công nghệ màn hình</td>\r\n<td>IPS LCD</td>\r\n</tr>\r\n<tr>\r\n<td>FM radio</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>GPS</td>\r\n<td>GLONASS/ GALILEO/ BDS/ A-GPS</td>\r\n</tr>\r\n<tr>\r\n<td>Model</td>\r\n<td>POCO X3 Pro</td>\r\n</tr>\r\n<tr>\r\n<td>Jack tai nghe</td>\r\n<td>3.5 mm</td>\r\n</tr>\r\n<tr>\r\n<td>Loại pin</td>\r\n<td>Li-Po</td>\r\n</tr>\r\n<tr>\r\n<td>Loại Sim</td>\r\n<td>2 Nano SIM</td>\r\n</tr>\r\n<tr>\r\n<td>Nghe nhạc</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ</td>\r\n<td>Trung Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Cổng sạc</td>\r\n<td>Type-C</td>\r\n</tr>\r\n<tr>\r\n<td>Trọng lượng</td>\r\n<td>215 g</td>\r\n</tr>\r\n<tr>\r\n<td>Quay phim</td>\r\n<td>FullHD 1080p@60fps /FullHD 1080p@30fps /4K 2160p@30fps</td>\r\n</tr>\r\n<tr>\r\n<td>Độ phân giải</td>\r\n<td>Full HD+ (1080 x 2400 Pixels)</td>\r\n</tr>\r\n<tr>\r\n<td>Kích thước màn hình</td>\r\n<td>6.67 inch</td>\r\n</tr>\r\n<tr>\r\n<td>Wifi</td>\r\n<td>Wi-Fi hotspot /Dual-band (2.4 GHz/5 GHz) /Wi-Fi Direct/ Wi-Fi 802.11 a/b/g/n/ac</td>\r\n</tr>\r\n<tr>\r\n<td>Xem phim</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>SKU</td>\r\n<td>8894677012178</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div class=\"group\">\r\n<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">MÔ TẢ SẢN PHẨM</h4>\r\n<div class=\"content\">\r\n<div class=\"ToggleContent__Wrapper-sc-1hm81e2-1 iGyNLs\">\r\n<div class=\"ToggleContent__View-sc-1hm81e2-0 eIzUuC\">\r\n<div>\r\n<h3 dir=\"ltr\"> ra mắt nổi bật với thiết kế khá độc đáo với cụm camera, màn hình mượt mà như lụa, pin khủng, sạc cực nhanh và loa chất lượng phòng thu hứa hẹn sẽ mang lại trải nghiệm người dùng ấn tượng.</h3>\r\n<h3 dir=\"ltr\">Thiết kế hiện đại, thời trang</h3>\r\n<p dir=\"ltr\">Ấn tượng đầu tiên của POCO X3 Pro chính là mặt lưng máy được hoàn thiện dạng trơn, đổ bóng, trong khi khu vực hai bên đã được làm nhám để mang lại cảm giác cầm tốt hơn thế hệ tiền nhiệm.</p>\r\n<p> </p>\r\n<p dir=\"ltr\">Về tổng thể POCO X3 Pro vẫn có thiết kế với vỏ ngoài và khung làm từ nhựa cải tiến khá nhẹ mà vẫn đảm bảo độ chắc chắn với khả năng chống bám mồ hôi hay vân tay, giúp  của bạn sẽ luôn đẹp như mới dù không đeo ốp bảo vệ.</p>\r\n<p> </p>\r\n<p dir=\"ltr\">Máy đi kèm với 3 với phiên bản màu: Phantom Black, Metal Bronze và Frost Blue cho người dùng tuỳ chọn theo nhu cầu sở thích của bản thân.</p>\r\n<h3 dir=\"ltr\">Màn hình giải trí sắc nét, tần số 120 Hz mượt mà</h3>\r\n<p dir=\"ltr\">Màn hình POCO X3 Pro có kích thước 6.67 inch độ phân giải Full HD+ với tỉ lệ 20:9 cùng khung viền mỏng mang lại không gian hiển thị lớn. </p>\r\n<p dir=\"ltr\"> </p>\r\n<p dir=\"ltr\">Hơn thế nữa, màn hình của POCO X3 Pro còn hỗ trợ tần số quét lớn lên đến 120 Hz mang lại cảm giác mượt mà trong các thao tác chạm, vuốt cũng như chuyển đổi giữa các ứng dụng.</p>\r\n<p> </p>\r\n<p dir=\"ltr\">Đồng thời, tốc độ lấy mẫu cảm ứng 240 Hz cao giúp giảm độ trễ cảm ứng và giúp kiểm soát độ nhạy trong trò chơi tốt hơn, nâng trải nghiệm chơi game của bạn lên một tầm cao mới.</p>\r\n<p dir=\"ltr\">Đặc biệt, màn hình POCO X3 Pro được trang bị lớp kính cường lực Gorilla Glass 6 bền bỉ trong quá trình sử dụng, giúp máy có thể sống sót khi rơi từ độ cao lên đến 1.6 m trên bề mặt cứng, thô ráp.</p>\r\n<p dir=\"ltr\"> </p>\r\n<p dir=\"ltr\">Hệ thống loa kép chuẩn Hi-Res Audio mang đến âm thanh chất lượng sống động, mạnh mẽ cho dù bạn đang chơi trò chơi hay nghe nhạc.</p>\r\n<h3 dir=\"ltr\">Hiệu năng mạnh mẽ với chip Snapdragon 860</h3>\r\n<p dir=\"ltr\">Về hiệu năng sử dụng, POCO X3 Pro sở hữu một hiệu năng mạnh mẽ, tiên tiến với chip Snapdragon 860 được sản xuất trên tiến trình 7 nm cho khả năng xử lý các tác vụ một cách nhanh chóng, mượt mà. </p>\r\n<p dir=\"ltr\"> </p>\r\n<p dir=\"ltr\">Đi kèm với đó là dung lượng  đáp ứng tốt khả năng đa nhiệm nhiều ứng dụng nặng một cách vượt trội.</p>\r\n<p> </p>\r\n<p dir=\"ltr\">Công nghệ tản nhiệt LiquidCool 1.0 Plus sẽ không làm bạn thất vọng giúp nhiệt tản ra mọi hướng để bạn không ngừng chơi game ở mức cấu hình tối đa.</p>\r\n<p dir=\"ltr\"> </p>\r\n<p>Máy có dung lượng  chuẩn UFS 3.1 mang lại không gian lưu trữ lớn kết hợp cùng tốc độ đọc và ghi cao giúp POCO X3 Pro tải trò chơi và ứng dụng giờ đây đã được thực hiện một cách nhanh hơn.</p>\r\n<h3 dir=\"ltr\">Hệ thống 4 camera 48 MP sắc nét</h3>\r\n<p dir=\"ltr\">Điện thoại POCO X3 Pro được trang bị hệ thống 4 camera sau với cảm biến chính có độ phân giải lên đến 48 MP. Các ống kính còn lại lần lượt là  8 MP, 2 MP và camera đo độ sau hỗ trợ chụp chân dung 2 MP.</p>\r\n<p> </p>\r\n<p dir=\"ltr\">Cụm camera độ phân giải cao cùng nhiều tính năng chụp ảnh như tự động lấy nét, phơi sáng, dễ dàng cho ra những thước phim, bức ảnh chất lượng cao, rõ ràng chân thực đến từng chi tiết.</p>\r\n<p> </p>\r\n<p dir=\"ltr\">POCO X3 Pro sở hữu camera trước với độ phân giải 20 MP, hỗ trợ AI làm đẹp, quay video Full HD mang lại khả năng chụp ảnh selfie chất lượng cao sẽ giúp bạn tự tin lưu giữ những khoảnh khắc hằng ngày.</p>\r\n<p> </p>\r\n<h3 dir=\"ltr\">Dung lượng pin 5160 mAh, hỗ trợ sạc nhanh 33 W</h3>\r\n<p dir=\"ltr\">POCO X3 Pro với viên pin dung lượng 5160 mAh giúp máy có thể hoạt động liên tục trong một thời gian dài. </p>\r\n<p> </p>\r\n<p dir=\"ltr\">Đặc biệt, máy còn được trang bị công nghệ  33 W giúp bổ sung năng lượng một cách nhanh chóng, đảm bảo bạn luôn sẵn sàng trong mọi hành trình.</p>\r\n<p dir=\"ltr\"> </p>\r\n<p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Tuy nhiên tuỳ vào từng loại sản phẩm hoặc phương thức, địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, ...</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),('32',76,0,'11','<div class=\"warranty-item\"><span class=\"itemLeft\">Thời gian bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">18 Tháng</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Hình thức bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Hóa đơn</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành chính hãng</span></div>'),('33',85,0,'11','Điện thoại Xiaomi POCO X3 PRO - Hàng Chính Hãng'),('34',75,0,'12','<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">THÔNG TIN CHI TIẾT</h4>\r\n<div class=\"group\">\r\n<div class=\"content has-table\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Dung lượng pin</td>\r\n<td>5000 mAh</td>\r\n</tr>\r\n<tr>\r\n<td>Bluetooth</td>\r\n<td>v5.0</td>\r\n</tr>\r\n<tr>\r\n<td>Thương hiệu</td>\r\n<td>Realme</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ thương hiệu</td>\r\n<td>Trung Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Camera sau</td>\r\n<td>Chính 13 MP &amp; Phụ 2 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Camera trước</td>\r\n<td>5 MP</td>\r\n</tr>\r\n<tr>\r\n<td>Hỗ trợ thẻ nhớ ngoài</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>Chip đồ họa (GPU)</td>\r\n<td>PowerVR GE8320</td>\r\n</tr>\r\n<tr>\r\n<td>Chip set</td>\r\n<td>MediaTek Helio G35 8 nhân</td>\r\n</tr>\r\n<tr>\r\n<td>Tốc độ CPU</td>\r\n<td>8 nhân 2.3 Ghz</td>\r\n</tr>\r\n<tr>\r\n<td>Kết nối dữ liệu</td>\r\n<td>Bluetooth, Wifi, 3G, 2G, 4G</td>\r\n</tr>\r\n<tr>\r\n<td>Đèn Flash</td>\r\n<td>Có</td>\r\n</tr>\r\n<tr>\r\n<td>Kích thước</td>\r\n<td>\r\n<p>Dài 164.4 mm - Ngang 75.9 mm - Dày 9.1mm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>Loại/ Công nghệ màn h