-0 jHTCJn\">MÔ TẢ SẢN PHẨM</h4>\r\n<div class=\"content\">\r\n<div class=\"ToggleContent__Wrapper-sc-1hm81e2-1 iGyNLs\">\r\n<div class=\"ToggleContent__View-sc-1hm81e2-0 eIzUuC\">\r\n<div>Màn hình: IPS LCD, 6.5\", HD+<br />Hệ điều hành: Android 10<br />Camera sau: Chính 13 MP &amp; Phụ 2 MP<br />Camera trước: 5 MP<br />CPU: MediaTek Helio G35 8 nhân<br />RAM: 2 GB<br />Bộ nhớ trong: 32 GB<br />Thẻ nhớ: MicroSD, hỗ trợ tối đa 256 GB<br />Thẻ SIM:<br />2 Nano SIM, Hỗ trợ 4G<br />Dung lượng pin: 5000 mAh</div>\r\n<div> </div>\r\n<div>\r\n<h5>Tràn đầy năng lượng với pin “siêu khủng” 5000 mAh</h5>\r\n<p>Thời lượng pin sẽ là điều bạn không phải lo lắng trên <strong>Điện Thoại Realme C11 (2GB/32GB)</strong>. Với viên pin dung lượng lên tới 5000 mAh, Realme C11 có thể chơi game trong 12,1 giờ, xem phim trong 21,6 giờ hoặc gọi thoại trong 31,9 giờ. Thỏa sức làm những điều mình thích trọn cả ngày dài mà không cần để ý đến việc hết pin. Thậm chí thời gian chờ của Realme C11 còn lên tới 40 ngày, hết sức ấn tượng.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/b0/1b/45/82fce8c6ce05bd40e6d3afe7f0586251.jpg\" alt=\"Điện Thoại Realme C11 (2GB/32GB) - Hàng Chính Hãng\" width=\"750\" height=\"474\" /></p>\r\n<h5>Màn hình tràn viền dạng “giọt nước” thời thượng</h5>\r\n<p>Tận hưởng những nội dung tuyệt đẹp trên màn hình lớn tới 6,5 inch của Realme C11. Chưa hết, màn hình này còn có viền siêu mỏng với kiểu dáng “giọt nước” thời thượng. Hình ảnh sẽ chiếm tới 88,7% diện tích mặt trước, đưa bạn đến không gian hiển thị rộng lớn, giải trí đầy thú vị, nhất là khi xem phim hay lướt web, vào mạng xã hội.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/08/d8/b3/bb908126deaf67e6e6acc1abd298ad0e.jpg\" alt=\"Điện Thoại Realme C11 (2GB/32GB) - Hàng Chính Hãng\" width=\"750\" height=\"543\" /></p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/d8/4b/79/cb98d89141f48fd9e3a56d3f8ac80dcf.jpg\" alt=\"Điện Thoại Realme C11 (2GB/32GB) - Hàng Chính Hãng\" width=\"750\" height=\"535\" /></p>\r\n<h5>Camera chụp đêm cực đỉnh</h5>\r\n<p>Mang trên mình cụm camera kép AI 13MP + 2MP và chế độ siêu chụp đêm, Realme C13 có thể dễ dàng ghi lại vẻ đẹp tuyệt diệu trong đêm tối. Những ngôi nhà cao tầng với ánh đèn lộng lẫy hay bầu trời đầy sao đều sẽ xuất hiện một cách chân thực qua ống kinh của Realme C13.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/4f/58/ef/982d742611f503ec92ece0a6c8c7ff06.jpg\" alt=\"Điện Thoại Realme C11 (2GB/32GB) - Hàng Chính Hãng\" width=\"750\" height=\"410\" /></p>\r\n<h5>Tỏa sáng nhờ camera selfie AI</h5>\r\n<p>Luôn luôn tỏa sáng rạng ngời, bạn sẽ hoàn toàn tự tin với những bức ảnh chụp từ camera trước của Realme C13. Công nghệ làm đẹp bằng trí tuệ nhân tạo AI sẽ tự động nhận diện và làm nổi bật những ưu điểm trên khuôn mặt bạn, đồng thời khéo léo xóa đi những khuyết điểm, để cho bạn dễ dàng có được bức ảnh đẹp nhất.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/7c/5f/b8/b8f5af5b5090ceeb8a2c474d76c3d67d.jpg\" alt=\"Điện Thoại Realme C11 (2GB/32GB) - Hàng Chính Hãng\" width=\"750\" height=\"426\" /></p>\r\n<h5>Mở khóa bằng nhận diện khuôn mặt</h5>\r\n<p>Không cần phải nhập mật khẩu hay làm bất cứ thao tác phức tạp nào để mở khóa máy nữa, đơn giản bạn chỉ cần đưa điện thoại lên, Realme C11 sẽ nhận diện khuôn mặt của bạn và mở khóa ngay lập tức. Điện thoại Realme C11 mang đến sự tiện lợi và an toàn khi sử dụng.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/99/96/57/ac8a333f45410516af9522a18659e64c.jpg\" alt=\"Điện Thoại Realme C11 (2GB/32GB) - Hàng Chính Hãng\" width=\"750\" height=\"500\" /></p>\r\n<h5>Cấu hình mạnh mẽ, tha hồ chơi game</h5>\r\n<p>Realme C11 có sức mạnh cấu hình vượt trội so với các sản phẩm cùng phân khúc giá. Bộ vi xử lý Helio G35 với 8 nhân tốc độ cao 2.3 GHz, sản xuất trên tiến trình 12nm giúp máy chạy mượt mà, phản hồi nhanh chóng. Bạn cũng có thể giải trí trên những tựa game yêu thích nhờ hiệu năng mạnh mẽ của Realme C11.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/c7/f4/6e/4fd3dab89e6bc37d068fd536dd8b72e5.jpg\" alt=\"Điện Thoại Realme C11 (2GB/32GB) - Hàng Chính Hãng\" width=\"750\" height=\"390\" /></p>\r\n<h5>Thiết kế đầy nghệ thuật</h5>\r\n<p>Dù là chiếc điện thoại thuộc phân khúc giá rẻ nhưng Realme C11 có thiết kế cao cấp, đậm chất riêng. Từ phần khung viền bo cong mượt mà, cụm camera hình vuông cá tính cho đến dải sẫm màu ở mặt lưng tạo điểm nhấn, tất cả tạo nên một chiếc điện thoại thiết kế rất đặc biệt. Hai màu sắc là Xanh Mint và Xám Hạt tiêu đều rất phong cách, thời trang và phù hợp với giới trẻ.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/5f/36/5d/7442e51c691b509d572dabad66671003.jpg\" alt=\"Điện Thoại Realme C11 (2GB/32GB) - Hàng Chính Hãng\" width=\"750\" height=\"475\" /></p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/7a/cb/f2/a6c3b39f091e797476a47c293e330186.jpg\" alt=\"Điện Thoại Realme C11 (2GB/32GB) - Hàng Chính Hãng\" width=\"750\" height=\"526\" /></p>\r\n<h5>Độ bền vượt thời gian</h5>\r\n<p>Mỗi chiếc điện thoại Realme C11 đều đã phải vượt qua những bài thử nghiệm về độ bền rất khắc nghiệt trước khi đến tay người dùng. Tất cả những phím cứng, cổng sạc, jack tai nghe đều được thử nghiệm hàng chục đến hàng trăm nghìn lần. Thậm chí Realme C11 cũng đã được thử nghiệm thả rơi để đảm bảo độ bền tốt nhất.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/5f/af/89/aa830761aa58c23e62bcd3f3bd002826.jpg\" alt=\"Điện Thoại Realme C11 (2GB/32GB) - Hàng Chính Hãng\" width=\"750\" height=\"365\" /></p>\r\n<h5>Đầy đủ 2 SIM và thẻ nhớ</h5>\r\n<p>Thay vì khe cắm “lai” như nhiều hãng khác, Realme C11 có khe cắm chứa đầy đủ 2 SIM và 1 thẻ nhớ để bạn sử dụng linh hoạt hơn. Việc sử dụng cùng lúc 2 SIM và thẻ nhớ vừa giúp cho công việc liên lạc tiện lợi, lại vừa cho không gian lưu trữ dữ liệu dồi dào.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/12/16/19/0152ff810196db663662dd30d53c42d2.jpg\" alt=\"Điện Thoại Realme C11 (2GB/32GB) - Hàng Chính Hãng\" width=\"750\" height=\"455\" /></p>\r\n<p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Tuy nhiên tuỳ vào từng loại sản phẩm hoặc phương thức, địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, ...</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),('35',76,0,'12','<div class=\"warranty-item\"><span class=\"itemLeft\">Thời gian bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">12 Tháng</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Hình thức bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Điện tử</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành chính hãng</span></div>'),('36',85,0,'12','Điện Thoại Realme C11 (2GB/32GB) - Hàng Chính Hãng'),('37',75,0,'13','<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">THÔNG TIN CHI TIẾT</h4>\r\n<div class=\"group\">\r\n<div class=\"content has-table\">\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Độ phân giải</td>\r\n<td>QVGA (240 x 320 Pixels)</td>\r\n</tr>\r\n<tr>\r\n<td>Kích thước màn hình</td>\r\n<td>2.4 inch</td>\r\n</tr>\r\n<tr>\r\n<td>Trọng lượng</td>\r\n<td>90,3 g</td>\r\n</tr>\r\n<tr>\r\n<td>Jack tai nghe</td>\r\n<td>3.5 mm</td>\r\n</tr>\r\n<tr>\r\n<td>Dung lượng pin</td>\r\n<td>1150 mAh</td>\r\n</tr>\r\n<tr>\r\n<td>Bluetooth</td>\r\n<td>5</td>\r\n</tr>\r\n<tr>\r\n<td>Thương hiệu</td>\r\n<td>Nokia</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ thương hiệu</td>\r\n<td>Phần Lan</td>\r\n</tr>\r\n<tr>\r\n<td>Kích thước</td>\r\n<td>\r\n<p>124,7 x 51,0 x 13,7 mm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>Loại/ Công nghệ màn hình</td>\r\n<td>LCD</td>\r\n</tr>\r\n<tr>\r\n<td>Loại Sim</td>\r\n<td>Nano SIM</td>\r\n</tr>\r\n<tr>\r\n<td>Xuất xứ</td>\r\n<td>Trung Quốc</td>\r\n</tr>\r\n<tr>\r\n<td>Cổng sạc</td>\r\n<td>Micro USB</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<div class=\"group\">\r\n<h4 class=\"BlockTitle__Wrapper-qpz3fo-0 jHTCJn\">MÔ TẢ SẢN PHẨM</h4>\r\n<div class=\"content\">\r\n<div class=\"ToggleContent__Wrapper-sc-1hm81e2-1 iGyNLs\">\r\n<div class=\"ToggleContent__View-sc-1hm81e2-0 eIzUuC\">\r\n<div>\r\n<h5>Thiết kế đơn giản, gọn nhẹ</h5>\r\n<p><strong>Điện Thoại Nokia 215 4G</strong> sử dụng chất liệu nhựa cho kiểu dáng bền bỉ, các nút cảm ứng mềm lớn, cạnh dễ cầm và mặt lưng cong được thiết kế để vừa vặn hoàn toàn trong tay bạn, cho bạn có được sự thoải mái, tiện lợi nhất.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/6a/eb/ee/72add503152477157704ef7bdada9d0e.jpg\" alt=\"\" width=\"750\" height=\"497\" /></p>\r\n<p>Màn hình 2.4 inch và độ phân giải 240 x 320 pixels cho người dùng những trải nghiệm và tiện ích khá thông dụng trên một chiếc Nokia thông thường.</p>\r\n<h5>Nhiều tính năng đa phương tiện, giải trí</h5>\r\n<p>Nokia 215 4G cũng được tích hợp các trò chơi có sẵn trên máy như rắn săn mồi, Crossy Road giúp bạn có những phút giây thư giản đầu óc sau những giờ làm việc, học tập mệt mỏi.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/22/1f/6d/6cb3ed215d485187001f9edcc00ce622.jpg\" alt=\"\" width=\"750\" height=\"497\" /></p>\r\n<p>Nhu cầu âm nhạc của bạn cũng được hỗ trợ, chế độ FM không dây cho bạn sự tiện hơn mỗi khi không có tai nghe. Máy cũng hỗ trợ thẻ nhớ ngoài tối đa 32 GB cho bạn lưu lại những bản nhạc yêu thích.</p>\r\n<h5>Khả năng kết nối mạng 4G </h5>\r\n<p>Tận hưởng cuộc gọi VoLTE cho chất lượng rõ nét, giảm tiếng ồn giúp cuộc gọi đàm thoại của bạn luôn được tốt nhất.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/0d/e7/2e/e037fa4a58340f3a2b5ff6bc84d580b3.jpg\" alt=\"\" width=\"750\" height=\"497\" /></p>\r\n<p>Điểm nổi bật của chiếc điện thoại này là được hỗ trợ 4G giúp máy có thể làm thêm được nhiều việc như lướt web đọc tin tức, kết nối mạng xã hội với 4G mọi nơi mọi lúc.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/ac/2f/66/7e13fe3fbcbf2a26132178a5aae7a767.jpg\" alt=\"\" width=\"750\" height=\"497\" /></p>\r\n<h5>Dung lượng pin lâu dài</h5>\r\n<p>Với pin 1150 mAh, việc sử dụng được 2 - 3 ngày là điều mà Nokia 215 4G có thể làm được. Và máy có thể tháo lắp lên việc thay sim hay thay pin đều trở nên dễ dàng cho bạn.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/5e/c9/48/193d68dddacd051ff1ba02d79670f03f.jpg\" alt=\"\" width=\"750\" height=\"496\" /></p>\r\n<p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Tuy nhiên tuỳ vào từng loại sản phẩm hoặc phương thức, địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, ...</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),('38',76,0,'13','<div class=\"warranty-item\"><span class=\"itemLeft\">Thời gian bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">12 Tháng</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Hình thức bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Hóa đơn</span></div>\r\n<div class=\"warranty-item\"><span class=\"itemLeft\">Nơi bảo hành </span><span class=\"itemRight\" data-view-id=\"pdp_view_warranty_info_button\">Bảo hành chính hãng</span></div>\r\n<div class=\"warranty-item\"> </div>'),('39',85,0,'13','Điện Thoại Nokia 215 4G - Hàng Chính Hãng'),('40',85,0,'14','Điện Thoại Nokia 105 Single Sim - Hàng Chính Hãng'),('41',85,0,'15','Điện Thoại Nokia 215 4G - Hàng Chính Hãng'),('42',85,0,'16','Điện Thoại Nokia 150 (2020) - Hàng Chính Hãng'),('43',85,0,'17','Điện Thoại Di Động GSM ZONO N8110 2.4inch – Hàng Nhập Khẩu - Vàng'),('44',85,0,'18','Điện Thoại Nokia 6300 4G - Hàng Chính Hãng'),('45',85,0,'19','ĐIỆN THOẠI DI ĐỘNG NGƯỜI GIÀ MASSTEL FAMI 11'),('46',85,0,'20','Điện Thoại Di Động GSM ZONO N8110 1.8inch – Hàng Nhập Khẩu'),('47',85,0,'21','Điện thoại Energizer E241S - Hàng Chính Hãng'),('48',85,0,'22','Điện Thoại Coolpad F110 - Hàng Chính Hãng'),('49',85,0,'23','Điện thoại Energizer E12 - Hàng Chính Hãng'),('50',85,0,'24','Điện thoại Mobell C310 - Hàng c