INSERT INTO `review_detail` VALUES (1,1,1,'I prefer more compartments','I prefer more compartments. If you don\'t mind putting everything in one space, it\'s fine. Good for the gym.','Chi',NULL),(2,2,1,'I use it a lot ','It\'s a good size and I use it a lot. My only issue with it was I wanted the handles to be longer so I can wear it on my back.','Filiberto',NULL),(3,3,1,'I\'ve had this thing for really long','I\'ve had this thing for a really long time and it barely shows any signs of wear and tear. It\'s really big, too! I\'ve taken it on day trips as well as short vacations and usually have no trouble finding room for my stuff.','Herb',NULL),(4,4,1,'Decent bag','Decent bag. I keep my stuff in it for work and the gym. It\'s nice and roomy. I wish it had a more sophisticated design, though. Kinda looks like it\'s for kids.','Craig',NULL),(5,5,1,'Screwed up my back','I can\'t believe they\'re claiming these straps are \"padded.\" Wearing this thing to class for a semester totally screwed up my back, and my shoulders would start to ache after a few minutes where the straps dug in.','Orville',NULL),(6,6,1,'Awesome bag','Awesome bag but I found it to be smaller than I thought. I haven\'t felt any additional strain on my back and I use it all day long for my job.','Marty',NULL),(7,7,1,'The back needs more padding','If the back had more padding I would recommend it for everyone. You can tell the material is strong and not cheap so it\'s definitely worth it.','Chase',NULL),(8,8,1,'I bought this backpack for my son','I bought this backpack for my son to take to school, but he carries it like a suitcase now! It\'s also really good for airplane travel.','Kennith',NULL),(9,9,1,'awesome for going back and forth','This is awesome for going back and forth to class. I live off campus and it\'s a longer walk, but this pack fits comfortably and I can even store my laptop in the main compartment.','Gaston',NULL),(10,10,1,'comfy and i don\'t feel like a loser','comfy and i don\'t feel like a loser carrying it.','Issac',NULL),(11,11,1,'The shoulder strap broke ','The shoulder strap broke the first time I used it. Awesome.','Daren',NULL),(12,12,1,'Good for work. Holds everything ','This is good for work. Holds everything I need. The fabric doesn\'t seem that strong, but so far so good.','Garry',NULL),(13,13,1,'Great bag! I use it for everything! ','Great bag! I use it for everything! Not sure what happened with the person who said the strap broke because mine is perfect. Maybe it was fluke? I\'d return it and try another. It\'s been awesome for me!','Quinn',NULL),(14,14,1,'This bag is really cool','This bag is really cool. I\'m an art major, so I have tons of supplies that I have to lug back and forth every day for class. I didn\'t think this would be big enough, but surprisingly it can hold just about all my stuff. I really like the way it looks too.','Jame',NULL),(15,15,1,'Color is weird','I wanted to like this bag, and it is definitely good quality, but the color is so weird in real life. From a distance it kind of looks like I just found it in a dumpster. Shame because that is the only drawback.','Adalberto',NULL),(16,16,1,'I am OBSESSED with these','I run 5 times a day and am OBSESSED with this watch! It tracks and calculates all the things my brain can\'t because I hate maths. PS I know this is a men\'s watch and I am not a man, but I have large wrists!','Refugio',NULL),(17,17,1,'This thing is awesome ','This thing is awesome and remembers all the stuff I\'ve stored. ','Jewel',NULL),(18,18,1,'It slides around on my wrist','It slides around on my wrist when I sweat. I\'ve tried making it smaller but that doesn\'t seem to help.','Brice',NULL),(19,19,1,'Working flawlessly','I recently replace my 25 year old watch with this one, so it had high expectations to live up to. So far all the features are working flawlessly, I only hope it lasts as long as my old one.','Billy',NULL),(20,20,1,'offers a lot of technology','can\'t say this is the coolest looking watch I\'ve ever owned (it\'s no FAMOUS DESIGNER or anything) but it has a lot to offer technology-wise','Marc',NULL),(21,21,1,'Hydration alarm','This was given as a gift to me and it wasn\'t the one I asked for, but I\'m starting to like the different perks like the hydration alarm','Luther',NULL),(22,22,1,'It works ok but the ugliness is blinding','It works ok but the ugliness is blinding I am literally blinded','Leon',NULL),(23,23,1,'Watch too tight','Watch too tight please email how to loosen it or I\'ll leave bad review','Max',NULL),(24,24,1,'No ticktock','I got it because I thought it would still make a ticktick noise even though it\'s digital, but it doesn\'t!','Chuck',NULL),(25,25,1,'Not a bad watch for the price','Not a bad watch for the price. Wish it had actual numbers instead of marks, though.','Robert',NULL),(26,26,1,'the only watch I wear','Hands down, it\'s the only watch I wear when I\'m out on a run. The strap is soft and smooth, and the face even glows in the dark.','Noe',NULL),(27,27,1,'Dual time zone settings','When I\'m in another country, I hate not knowing what time it really is back home so the dual time zone settings are awesome!','Frank',NULL),(28,28,1,'Really perfect for travel ','Really perfect for my needs. I travel a ton, so I\'ll always know what time to give my wife a call back home.','Jamie',NULL),(29,29,1,'I really like the modern look','I really like the modern look of this watch, but I could only get one time zone to work. I hope it has a warranty because I\'m sending it back!','Bobby',NULL),(30,30,1,'This watch is so tight','This watch is so tight around my wrist! I don\'t care if it\'s adjustable, it cuts off my circulation.','Tommie',NULL),(31,31,1,'I bought this bag for my daughter','I bought this bag for my daughter because she travels all the time and she loves it! It\'s easy for her to roll and carry by herself even when full. ','Shella',NULL),(32,32,1,'Goes everywhere with me','I\'ve taken this bag to so many places and everything still works. I hate when the threads start to come apart and the zipper gets caught after like 2 uses. So far so good!','Crissy',NULL),(33,33,1,'The material is a little thin','The material is a little thin so I\'m afraid it won\'t last long. The zippers slide really nice and the wheels are good on the pavement. Overall a good purchase.','Alene',NULL),(34,34,1,'OBSESSED with this!','OBSESSED with this! I love that it\'s adjustable! A bit more expensive than I wanted, but TOTALLY worth it.','Cliff',NULL),(35,35,1,'Great but pricey','This totally makes me feel like I\'m actually working my muscles. The adjustable thing is awesome. A bit pricey though.','Fiona',NULL),(36,36,1,'I hate working out...This does not help.','I hate working out...This does not help.it gets tangled really easily.can\'t even get threw 1 work out with it. Returning.','Ardith',NULL),(37,37,1,'Want more resistance','Its great to be able to work out at home and sometimes on my lunch break at work - I wish this provided more resistance, though.','Randy',NULL),(38,38,1,'Agreed. More resistance','Agreed. I can do plenty of exercises with it and its awesome for when I can\'t make it to the gym, but I\'d like more resistance, too.','Keren',NULL),(39,39,1,'Too lazy to go to gym','I use these when I\'m too lazy to go to the gym. Really helps me stay in shape. I have already adjusted several times to increase the tension because I\'m getting stronger!','Madeleine',NULL),(40,40,1,'Do not buy!','Tried to adjust one and the plastic part just snapped in half. Very Disappointed. Do not buy!','Ricky',NULL),(41,41,1,'They work, nothing special. ','They work, nothing special. I had a set that I liked better but my ex stole it.   ','Krystle',NULL),(42,42,1,'Good value for the price','pretty satisfied with this jump rope. good value for the price','Lavonia',NULL),(43,43,1,'I BRING THIS TO ALL MY MEETS!','I BRING THIS TO ALL MY MEETS FOR WARMUP!!! BARELY TAKES UP ANY SPACE IN MY BAG','Andy',NULL),(44,44,1,'perfect for when I\'m too lazy','this is so perfect for when I\'m too lazy to go to the gym. I do a few pushups and then whip out the jump rope and work on my cardio. It\'s a quick workout that makes me feel greaat and I don\'t even have to leave the house','Orville',NULL),(45,45,1,'PURPLES','I bought these pushup grips because they came in purple!! my boyfriend has his own and I love using them but the purple was so perfect for me because I\'m a girly girl at heart','Toya',NULL),(46,46,1,'these are ok','these are ok, but my brother has the military ones and I like them loads better','Johanne',NULL),(47,47,1,'Will whip you into shape!','these things whip you into shape! a month after I got them and used them several times aeach week I could see a huge difference in my muscle tone. very happy with the results!!!  :)','Ashlea',NULL),(48,48,1,'Easy to clean','Wide mouth opening makes it easy to clean! ','Olimpia',NULL),(49,49,1,'Perfect weight','I always found 10 lb weights too light and 20 lb too heavy. This is just right!','Danielle',NULL),(50,50,1,'should\'ve got a while ago','I don\'t know why I didn\'t get this years ago. I\'ve been diligently doing ab workouts every day with little effect. Incorporated this into my routine and BAM! I can see my love handles melting away!','Keith',NULL),(51,51,1,'I love this bag! It\'s cute','I love this bag! It\'s cute and doesn\'t advertise that I\'m going to the gym like a duffel bag.','Dodie',NULL),(52,52,1,'I pack a TON of stuff','I take a TON of stuff to the gym and yoga studio. Way more than I should but this bag still allows me to carry a bunch of it. I like taking it better than any other bag.','Tara',NULL),(53,53,1,'Wish there were pockets ','I like it but I wish there were pockets on the inside instead of just one big space. I didn\'t think it would fit inside my locker but it did.','Chasidy',NULL),(54,54,1,'Motivated by this Bag!','I purchased this bag hoping it would give me more motivation to go to the gym and it has! Not too big, sized just right for me and all my friends love it :)','Tamisha',NULL),(55,55,1,'Wish it had more pocket','Wish it had more pockets, but it\'s still good. A shoulder strap would also have been nice.','Lidia',NULL),(56,56,1,'Fits tons of gear','I take this along whenever I head up to my cabin. Fits tons of gear plus a few of my favorite electronics. And duct tape.','Elizabeth',NULL),(57,57,1,'ok bag for a day\'s hike','ok bag for a day\'s hike around Hawk Mountain. Needs a sturdier top handle tho, things ripped','Sueann',NULL),(58,58,1,'I bike four miles a day to work and back','I bike four miles a day to work and back and I love this thing. It\'s a good size and it\'s pretty comfortable to wear across my back while I ride. So far I have not noticed much wear and tear on the fabric and I\'ve had it for 6 months.','Sadye',NULL),(59,59,1,'I would love this bag EXCEPT . . .','I would love this bag EXCEPT with the case on my Iphone won\'t fit in the cell phone pocket! Why make a pocket for cell phones if it\'s not going to fit an Iphone.','Adena',NULL),(60,60,1,'it\'s really ugly,','Its fine I guess but it\'s really ugly, I picked out a really cute bag for college but my mom got me this one instead.','Tracee',NULL),(61,61,1,'What\'s not to like about this bag?!!','What\'s not to like about this bag?!! It\'s simple, clean and modern, and it fits me perfeclty. The roominess is a big plus when I make multiple trips to the gym then the grocery store then wherever else. LOVE IT! ','Anglea',NULL),(62,62,1,'Did I get floor model?','I must have a floor model or soemthin cuz when I ordered it it came all stained up, some brown crust or somethin. Gross. I requested a refund so we\'ll see. Other than that I think it\'s a quality bag, just disappointed with mine. ','Lasandra',NULL),(63,63,1,'I bought this backpack for my daughter','I bought this backpack for my daughter who\'s going to college this year. Her campus is huge and I was concerned that she would hurt her back lugging all those books around. It seems like there\'s enough padding!','Francesca',NULL),(64,64,1,'I heart this backpack so hard. ','I heart this backpack so hard. The colors are soooo cute and there\'s enough room for all my stuff xoxo ','Susy',NULL),(65,65,1,'Can I give zero stars?','I would give this bag zero stars if I could!!!  All of the zippers fell off the first tim I used it!!!  DON\'T BUY THIS ','Ingeborg',NULL),(66,66,1,'Um, not actually waterproof','This bag is definitely not waterproof. I accidentally left it outside in a downpour, and my clothes got soaked. I\'m disappointed!','Aiko',NULL),(67,67,1,'A roomy duffle','I really love how roomy the duffle is. I\'m a clotheshorse, so I like to take a lot of outfits with me when I go away. I have no problem stuffing it all in. It\'s not a very stylish bag, but it serves its purpose.','Dollie',NULL),(68,68,1,'doesn\'t hold that much','It doesn\'t hold that much, so it\'s really just good for a night or two away. It\'s also pretty plain looking, so for those who like bells and whistles, look elsewhere.','Caroyln',NULL),(69,69,1,'Good bank for small hand','I bought this watch specifically for its band because I have really small wrists and have a hard time finding watches that fit, even ones that say women\'s. This one fit wonderfully and I could even make it smaller!','Desiree',NULL),(70,70,1,'Super sleek, love it. ','Super sleek, love it. I\'m buying another as a gift!','Cecelia',NULL),(71,71,1,'My mom loves it','I bought this watch for my mom to workout with and she loves it. It\'s not too difficult for her to set and she uses it all the time now.','Natosha',NULL),(72,72,1,'Not classical but cool','Even though I\'m a fan of classic/traditional styles, I bought this watch for something different since it\'s fun and I could really use for tracking my sprints. I have no complaints!','Pok',NULL),(73,73,1,'Buckle BROKE','my buckle BROKE off the 2nd time I wore it. And then I had issues getting a replacement even with the warranty. Luma needs to stick to clothing basics because they clearly are out of their league with the more technical stuff. UGH','Grace',NULL),(74,74,1,'It died after  a week','It died after  a week of infuriating malfunctionality! First that little plastic screen that houses the numbers - yeah. it popped off in 24 hours. Okay, no problem i thought, i\'ll just not touch any thing vital. Then the metal back popped off and landed in the toilet so there was just no recovering that. THEN  the buckle broke! In the trash it went!','Nadia',NULL),(75,75,1,'The strap broke','The strap broke, which made me think I have fat wrists but I don\'t.','Laronda',NULL),(76,76,1,'Pieces kept coming off','Pieces kept coming off.','Colleen',NULL),(77,77,1,'Keeps excellent time and is pretty tough','Keeps excellent time and is pretty tough! Still no scratches or scuffs after a year of wearing it.','Denese',NULL),(78,78,1,'Has been through quite a few adventures ','Has been through quite a few adventures and vacations with me and still looks and runs great. That includes plenty of trips to water parks with the kids! ','Joette',NULL);
